text = {
	["Default"] = { name = "-", desc = "ลายสีไม่มีชื่อ" },
	["so_yellow"] = { name = "Bulldozer", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนในไลน์การผลิตโดยการจัดโครงสีรูปแบบสีเหลือง\n\nเครื่องบดกระดูกนี้เป็นจอมทำลายล้าง" },
	["so_olive"] = { name = "Groundwater", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบสีเขียวอมเหลือง" },
	["so_red"] = { name = "Candy Apple", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบสีแดงและสีดำ\n\nดีกับรถ ดีกว่าอาวุธ" },
	["so_purple"] = { name = "Ultraviolet", desc = "มันถูกลงสีด้วยสเปรย์ในแต่ละส่วนโดยการจัดโครงสีรูปแบบสีดำและสีม่วง\n\nการออกแบบที่สง่างามที่มาพร้อมกับจิตสังหารมุ่งร้าย" },
	["so_night"] = { name = "Night", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบหน่วยปฏิบัติการตอนกลางคืน\n\nมันเป็นเสียงกระซิบของสายลม... ที่จะฝังเขี้ยวไปที่คอของคุณ" },
	["so_caramel"] = { name = "Caramel", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบสีคาราเมลและสีดำ" },
	["so_grassland"] = { name = "Grassland", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบทุ่งหญ้า" },
	["so_moss"] = { name = "Blue Spruce", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบตะไคร่น้ำ" },
	["so_sand"] = { name = "Sand Dune", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบทะเลทราย\n\nด้วยการตายของเทอร์เนอร์ เรามีภารกิจสำคัญใหม่: ช่วยเหลืออเล็กซ์ คินเคด - ผู้บังคับบัญชาการ เฟลิกซ์ ไรลีย์" },
	["so_stormfront"] = { name = "Storm", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบพายุหนัก\n\nมันจะรอคุณอยู่ที่โมโนเรล" },
	["so_tornado"] = { name = "Tornado", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบทอร์นาโด\n\nอย่าถูกหลอกด้วยความเรียบง่ายของมัน" },
	["so_whiteout"] = { name = "Whiteout", desc = "มันถูกลงสีด้วยสเปรย์สีขาวทั้งหมด\n\nมันดูไร้พิษภัย แต่อย่ามองเพียงรูปลักษณ์ภายนอก" },
	["so_jungle"] = { name = "Jungle", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบป่าไม้" },
	["so_space_marine"] = { name = "Colony", desc = "มันถูกลงสีด้วยสเปรย์สีกากีและสีเทา" },
	["so_pmc"] = { name = "Contractor", desc = "มันถูกลงสีด้วยสเปรย์ในแต่ละส่วนด้วยสี สีน้ำตาล สีกรมท่า และสีเขียวเข้ม\n\nโรน่า ซาบรียังคงไม่ยกโทษให้เซบาสเตียนที่ไม่เลือกให้เธอตามเทอร์เนอร์ไป" },
	["so_tangerine"] = { name = "Demolition", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยใช้สีดำและสีส้ม\n\nโรน่าเป็นคนเก่งอย่างที่เธอคิดว่าเธอเป็น... แต่เธอแค่อายุไม่มากพอจะตระหนักว่าเธอไม่ควรเอามาเป็นประเด็นกับทุกคน - ผู้บังคับบัญชาการ เฟลิกซ์ ไรลีย์" },
	["so_orange_accents"] = { name = "Nitro", desc = "so_orange_accents" },
	["cu_broken_path_famas"] = { name = "Afterimage", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายเส้นริบบิ้นที่ยุ่งเหยิง" },
	["cu_bullet_rain_m4a1"] = { name = "Bullet Rain", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายกราฟิกห่าฝนกระสุนปืน" },
	["cu_catskulls_p90"] = { name = "Death by Kitty", desc = "มันถูกลงสีด้วยลายกะโหลกแมวซ้อนกันโดยใช้ฟิล์มลอยน้ำ" },
	["CSGO_Doomkitty"] = { name = "Doomkitty", desc = "CSGO_Doomkitty" },
	["hy_ddpat"] = { name = "Forest DDPAT", desc = "มันถูกลงสีด้วยลายพรางดิจิทัล (DDPAT) โดยใช้ฟิล์มลอยน้ำ \n\nเมื่อถึงเวลาที่คุณได้อยู่ใกล้พอที่จะสังเกตเห็นลายพิกเซล มันก็สายเกินไปเสียแล้ว" },
	["hy_ddpat_urb"] = { name = "Urban DDPAT", desc = "hy_ddpat_urb" },
	["hy_ddpat_jungle"] = { name = "Jungle DDPAT", desc = "hy_ddpat_jungle" },
	["hy_ddpat_orange"] = { name = "Orange DDPAT", desc = "hy_ddpat_orange" },
	["hy_ddpat_pink"] = { name = "Pink DDPAT", desc = "hy_ddpat_pink" },
	["hy_ddpat_desert"] = { name = "Desert DDPAT", desc = "hy_ddpat_desert" },
	["hy_arctic"] = { name = "Arctic Camo", desc = "มันถูกลงสีด้วยลายพรางหิมะโดยใช้ฟิล์มลอยน้ำ\n\nหิมะนั้นหนาวเย็น แต่ความตายนั้นหนาวเย็นกว่า" },
	["hy_arctic_contrast"] = { name = "Polar Camo", desc = "hy_arctic_contrast" },
	["hy_arctic_glacier"] = { name = "Arctic Glacier Camo", desc = "hy_arctic_glacier" },
	["hy_dive"] = { name = "Dive Camo", desc = "มันถูกลงสีด้วยลายพรางสีน้ำเงินโดยใช้ฟิล์มลอยน้ำ\n\nพวกเราคือโลกแห่งการมีลับลมคมใน...แต่ในบางเวลาก็ต้องเปิดเผยลายพรางให้ผู้อื่นเห็น - บูธ นักค้าอาวุธ" },
	["hy_ocean"] = { name = "Bright Water", desc = "hy_ocean" },
	["hy_forest"] = { name = "Wood Camo", desc = "มันถูกลงสีด้วยลายพรางป่าไม้โดยใช้ฟิล์มลอยน้ำ\n\nป่าไม้อาจจะเป็นสถานที่อันตรายได้... อย่าทำการท่องเที่ยวเพียงคนเดียว" },
	["hy_forest_winter"] = { name = "Winter Forest", desc = "hy_forest_winter" },
	["hy_forest_boreal"] = { name = "Boreal Forest", desc = "hy_forest_boreal" },
	["hy_forest_night"] = { name = "Forest Night", desc = "hy_forest_night" },
	["hy_desert"] = { name = "Desert Storm", desc = "มันถูกลงสีด้วยลายพรางทะเลทรายโดยใช้ฟิล์มลอยน้ำ" },
	["hy_tiger"] = { name = "Bengal Tiger", desc = "มันถูกลงสีด้วยลายเสือโคร่งเบงกอลโดยใช้ฟิล์มลอยน้ำ" },
	["hy_copperhead"] = { name = "Copperhead", desc = "มันถูกลงสีด้วยลายหนังงูคอปเปอร์เฮดโดยใช้ฟิล์มลอยน้ำ" },
	["hy_skulls"] = { name = "Skulls", desc = "มันถูกลงสีด้วยลายหัวกะโหลกโดยใช้ฟิล์มลอยน้ำด้วยโทนสีแดงและดำ\n\nสุสานขนาดใหญ่ที่จับได้เต็มกำมือของคุณพอดี" },
	["hy_webs"] = { name = "Crimson Web", desc = "มันถูกลงสีด้วยลายใยแมงมุมโดยใช้ฟิล์มลอยน้ำบนสีรองพื้นสีแดงและเคลือบแบบกึ่งเงาปิดท้าย\n\nระวังที่คุณเดินอยู่ให้ดี คุณไม่มีทางรู้หรอกว่าใยแมงมุมมันแผ่ไปถึงไหนแล้ว" },
	["hy_splatter"] = { name = "Blue Streak", desc = "มันถูกลงสีด้วยลายน้ำกระเซ็นแบบกึ่งโปร่งแสงโดยใช้ฟิล์มลอยน้ำบนสีรองพื้นสีฟ้า" },
	["hy_ak47lam"] = { name = "Red Laminate", desc = "ด้ามปืนของมันเป็นแบบไม้ลามิเนต" },
	["hy_ak47lam_bw"] = { name = "Black Laminate", desc = "hy_ak47lam_bw" },
	["hy_ak47lam_blue"] = { name = "Blue Laminate", desc = "hy_ak47lam_blue" },
	["hy_gelpen"] = { name = "Gunsmoke", desc = "มันถูกลงสีด้วยลายเส้นปากกาเจลขยุกขยิกโดยใช้ฟิล์มลอยน้ำ" },
	["hy_v_tiger"] = { name = "Jungle Tiger", desc = "มันถูกลงสีด้วยลายเสือสีป่าไม้โดยใช้ฟิล์มลอยน้ำ" },
	["hy_redtiger"] = { name = "Blood Tiger", desc = "hy_redtiger" },
	["hy_zombie"] = { name = "Virus", desc = "มันถูกลงสีด้วยลายซอมบี้โดยใช้ฟิล์มลอยน้ำบนสีรองพื้นสีเขียว" },
	["hy_granite"] = { name = "Granite Marbleized", desc = "มันถูกลงสีด้วยลายหินอ่อน" },
