	["sp_spray"] = { name = "Contrast Spray", desc = "มันถูกลงสีด้วยสเปรย์แบบอิสระด้วยมือพร้อมด้วยลายเส้นที่สั้นและหนาในสีที่ตัดกัน\n\nยอดเยี่ยมสำหรับผู้ปฏิวัติในขณะเดินทาง" },
	["sp_spray_sage"] = { name = "Sage Spray", desc = "sp_spray_sage" },
