	["sp_spray_army"] = { name = "Army Recon", desc = "sp_spray_army" },
	["sp_tape_dots"] = { name = "Dry Season", desc = "มันถูกลงสีด้วยสเปรย์โดยใช้เทปกาวแปะและใช้ตะแกรงเหล็กเจาะรูเป็นลายฉลุ" },
	["sp_tape_dots_urban"] = { name = "Urban Perforated", desc = "sp_tape_dots_urban" },
	["sp_tape_dots_waves"] = { name = "Waves Perforated", desc = "sp_tape_dots_waves" },
	["sp_leaves"] = { name = "Forest Leaves", desc = "มันถูกลงสีด้วยสเปรย์โดยใช้ใบไม้เป็นลายฉลุ" },
	["sp_leaves_grassland"] = { name = "Grassland Leaves", desc = "sp_leaves_grassland" },
	["sp_short_tape"] = { name = "Lichen Dashed", desc = "มันถูกลงสีด้วยสเปรย์โดยใช้ชิ้นส่วนสั้น ๆ ของเทปกาวเป็นลายฉลุ" },
	["sp_short_tape_jungle"] = { name = "Jungle Dashed", desc = "sp_short_tape_jungle" },
	["sp_short_tape_sand"] = { name = "Sand Dashed", desc = "sp_short_tape_sand" },
	["sp_short_tape_urban"] = { name = "Urban Dashed", desc = "sp_short_tape_urban" },
	["sp_tape"] = { name = "Bone Mask", desc = "มันถูกลงสีด้วยสเปรย์โดยใช้เทปกาวเป็นลายฉลุ\n\nแสดงอำนาจที่แท้จริงได้ด้วยการประยุกต์ใช้ที่ฉาญฉลาด" },
	["sp_tape_orange"] = { name = "Orange Peel", desc = "sp_tape_orange" },
	["sp_tape_urban"] = { name = "Urban Masked", desc = "sp_tape_urban" },
	["sp_mesh"] = { name = "Driftwood Mesh", desc = "มันถูกลงสีด้วยสเปรย์โดยใช้ตาข่ายลวดและกล่องกระดาษที่ถูกตัดออกมาเป็นลายฉลุ\n\nนักล่าก็คือนักล่าอยู่วันยังค่ำ โดยไม่สำคัญว่าสภาพแวดล้อมจะเป็นแบบไหนก็ตาม" },
	["sp_mesh_tan"] = { name = "Safari Mesh", desc = "sp_mesh_tan" },
	["sp_mesh_arctic_contrast"] = { name = "Polar Mesh", desc = "sp_mesh_arctic_contrast" },
	["sp_mesh_fire"] = { name = "Condemned", desc = "sp_mesh_fire" },
	["sp_mesh_glacier"] = { name = "Glacier Mesh", desc = "sp_mesh_glacier" },
	["sp_mesh_sand"] = { name = "Sand Mesh", desc = "sp_mesh_sand" },
	["sp_snake"] = { name = "Snake Camo", desc = "มันถูกลงสีด้วยสเปรย์โดยใช้ลายฉลุหนังงูเป็นหย่อม ๆ ซึ่งมีเส้นรอบนอกที่ใช้มือเปล่าพ่นแบบอิสระ" },
	["an_silver"] = { name = "Silver", desc = "มันถูกลงสีด้วยสีรองพื้นโครเมียมและเคลือบเงาบนสีเงินโปร่งใสรูปแบบอโนไดซ์\n\nมีความงดงามในแบบที่เรียบง่าย - นักวางกลยุทธ์ฟีนิกซ์ ฟรานซ์ ครีเกลด์" },
	["an_red"] = { name = "Hot Rod", desc = "มันถูกลงสีด้วยสีรองพื้นโครเมียมและเคลือบเงาสีแดงโปร่งแสงรูปแบบอโนไดซ์\n\nออโต้เมติก ซิสเทเมติก ไฮโดรเมติก" },
	["an_gunmetal"] = { name = "Anodized Gunmetal", desc = "an_gunmetal" },
	["an_navy"] = { name = "Anodized Navy", desc = "มันถูกลงสีด้วยสีรองพื้นโครเมียมและเคลือบเงาสีกรมท่าโปร่งแสงรูปแบบอโนไดซ์" },
	["am_urban"] = { name = "Metallic DDPAT", desc = "มันถูกลงสีด้วยลายพรางดิจิทัล (DDPAT) แนวตัวเมืองโดยใช้ฟิล์มลอยน้ำบนสีรองพื้นเมทัลลิก" },
	["am_tiger"] = { name = "Gold Tiger", desc = "มันถูกชุบด้วยทองและแกะสลักด้วยมือในลายของเสือ" },
	["am_dragon_glock"] = { name = "Dragon Tattoo", desc = "มันถูกลงสีด้วยรูปลอกลายมังกรบนสีรองพื้นเมมัลลิก\n\nในนิทานอัศวินมักจะปราบมังกรอยู่ตลอด... แต่นี่คือโลกแห่งความจริง - นักปฏิวัติ วาเลเรีย เจนเนอร์" },
	["am_caustics"] = { name = "Caustics", desc = "มันถูกลงสีด้วยสีแดงและขาวโดยใช้ฟิล์มลอยน้ำบนสีรองพื้นเมทัลลิกคาร์บอน" },
	["am_lightning_awp"] = { name = "Lightning Strike", desc = "มันถูกลงสีด้วยลายสายฟ้าโดยใช้รูปแบบอโนไดซ์บนสีรองพื้นเมทัลลิก\n\nในบางครั้งคุณคงไม่ต้องการให้ฟ้าผ่าลงมาที่เดิมซ้ำสอง" },
	["am_ossify"] = { name = "Ossified", desc = "มันถูกลงสีด้วยลายแบบนามธรรมโปร่งแสงสีเขียวสะท้อนแสงโดยใช้ฟิล์มลอยน้ำบนสีรองพื้นเมทัลลิก" },
	["aa_flames"] = { name = "Blaze", desc = "มันถูกลงสีด้วยการใช้แอร์บรัชสีแบบโปร่งแสงบนสีรองพื้นโครเมียม" },
	["aa_splash_p250"] = { name = "Splash", desc = "มันถูกลงสีด้วยการใช้แอร์บรัชสีแบบโปร่งแสงผ่านลายฉลุบนสีรองพื้นโครเมียม" },
	["aa_fade"] = { name = "Fade", desc = "มันถูกลงสีด้วยการแอร์บรัชสีแบบโปร่งแสงที่เจือจางรวมเข้ากันกับสีรองพื้นโครเมียม\n\nสิ่งนี้มันไม่เป็นเพียงแค่อาวุธเท่านั้น แต่มันเป็นส่วนหนึ่งของการสนทนา - นักค้าอาวุธฝึกหัด อิโมเจน" },
	["aa_fade_metallic"] = { name = "Amber Fade", desc = "aa_fade_metallic" },
	["aa_fade_grassland"] = { name = "Acid Fade", desc = "aa_fade_grassland" },
	["aq_copper"] = { name = "Copper", desc = "มันถูกชุบด้วยทองแดง" },
