	["am_zebra_dark"] = { name = "Dark Water", desc = "มันถูกลงสีด้วยลายน้ำพร้อมด้วยสีเมทัลลิกคาร์บอนที่มีค่าความสะท้อนแสงหลายจุดบนสีรองพื้นโครเมียม\n\nสายน้ำมอบชีวิต แต่มันก็ยังสามารถพรากชีวิตได้เช่นกัน..." },
