	["am_slither_p90"] = { name = "Cold Blooded", desc = "มันถูกลงสีด้วยสีรองพื้นโครเมียมและลงสีแคนดี้ในสีแดงโปร่งแสงรูปแบบอโนไดซ์ มันถูกสลักด้วยเลเซอร์ด้วยแม่ลายงูเลื้อย" },
