	["so_orca"] = { name = "Tuxedo", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีด้วยสีดำและสีขาว\n\nสำหรับเมื่อการต่อสู้ก็เหมือนเรื่องผูกเนคไทดำ" },
	["am_army_shine"] = { name = "Army Sheen", desc = "มันถูกคลุมด้วยฟอยล์โลหะจากนั้นถูกประทับด้วยลายอำพรางตา\n\nจำการฝึกของคุณไว้ให้ดี" },
	["am_oval_hex"] = { name = "Caged Steel", desc = "มันถูกลงสีด้วยรูปแบบลายหกเหลี่ยมโดยใช้สีเกล็ดโลหะ จากนั้นหุ้มด้วยฟิล์มลอยน้ำรูปวงรี\n\nพูดไม่ชัด!" },
	["cu_pinstripe_ak47"] = { name = "Emerald Pinstripe", desc = "มันถูกทำด้ามด้วยไม้โอ๊คและลงสีด้วยลายสีขาวและเขียว\n\nการตั้งคำถามอิโมเจนเป็นการตั้งคำถามฉันด้วย ช่วยใจเย็นลง ดื่มสก๊อตสักนิดและมาคุยเรื่องธุรกิจกัน - The Father and The Phoenix Part 2" },
	["sp_nightstripe"] = { name = "Night Stripe", desc = "มันถูกลงสีด้วยสเปรย์พร้อมลายทำเครื่องหมายเทปในรูปแบบสีพร้อมปฏิบัติการกลางคืน\n\nพ่นสเปรย์... สวดภาวนา... วาดภาพ... แทงมัน" },
	["cu_m4_asimov"] = { name = "Asiimov", desc = "มันถูกลงสีแบบกำหนดเองด้วยการออกแบบแนวไซไฟ\n\nไม่ว่าใครก็สามารถคาดเดาอนาคตได้... เพียงแค่มีจินตนาการ" },
	["cu_sawedoff_octopump"] = { name = "The Kraken", desc = "มันถูกลงสีด้วยมือพร้อมด้วยรูปภาพของปลาหมึก\n\nมันได้ถูกปลดปล่อยออกมาแล้ว" },
	["cu_m4a1-s_elegant"] = { name = "Guardian", desc = "มันถูกลงสีด้วยสีน้ำเงินเข้มและลงลายฉลุด้วยโลโก้ CT บนแมกกาซีน\n\nฉันไม่ชอบคุณ แต่ฉันต้องปกป้องคุณให้ปลอดภัย - ผู้เชี่ยวชาญการแทรกซึม คาร์เมน โคซิเนโร" },
	["cu_p250_refined"] = { name = "Mehndi", desc = "มันถูกลงสีด้วยลายเพสลีย์โดยใช้ฟิล์มลอยน้ำ\n\nนามาสเต้" },
	["cu_awp_cobra"] = { name = "Redline", desc = "มันถูกลงสีด้วยลายคาร์บอนไฟเบอร์โดยใช้ฟิล์มลอยน้ำและรูปลอกแบบไม่ใช้น้ำด้วยลายเส้นริ้วสีแดง\n\nไม่เคยเกรงกลัวต่อการก้าวข้ามขีดจำกัด" },
	["cu_famas_pulse"] = { name = "จังหวะ, จังหวะกด", desc = "มันถูกลงสีด้วยลายเศษชิ้นส่วนหนาสีแดงม่วงโดยใช้ฟิล์มลอยน้ำ\n\nสีที่โดดเด่นสำหรับอาวุธที่โดดเด่น" },
	["hy_marina_sunrise"] = { name = "Marina", desc = "มันถูกลงสีด้วยสีเหลืองและสีน้ำเงินที่ตัดกันโดยใช้ฟิล์มลอยน้ำ\n\nบางคนจะเรียกคุณว่าเป็นฮีโร่... ส่วนคนอื่นจะว่าคุณเป็นตัวร้าย" },
	["am_thorny_rose_mp9"] = { name = "Rose Iron", desc = "มันถูกลงสีด้วยมือพร้อมด้วยลายดอกกุหลายและหนามในสีเมทัลลิกที่มีสีต่างกัน\n\nระวังหนามจำนวนมากมายของมันให้ดี" },
	["cu_skull_nova"] = { name = "Rising Skull", desc = "มันถูกดัดแปลงด้วยรูปภาพของหัวกะโหลกโดยใช้สีผิวด้านและสีที่มีน้ำมันเป็นส่วนประกอบฐาน\n\nคุณอิซากิ ผมไม่ได้บ่นอยู่นะ... แต่คุณต้องการปืนลูกซองมากแค่ไหนกันแน่? - Imogen and The Oni Part 1" },
	["cu_sandstorm"] = { name = "Sandstorm", desc = "มันถูกลงสีด้วยการออกแบบกราฟิกสีม่วงและสีน้ำตาลอมเหลืองโดยใช้ฟิล์มลอยน้ำ\n\nมันจะต้องใช้มากกว่าผ้าใบเพื่อปกป้องตัวของคุณ" },
	["hy_kami"] = { name = "Kami", desc = "มันถูกลงสีด้วยลายหนังสือการ์ตูนญี่ปุ่นโดยใช้ฟิล์มลอยน้ำ\n\nผีบางตัวก็ไม่ยอมให้ถูกฝังอยู่เฉย ๆ" },
	["aq_obsidian"] = { name = "Magma", desc = "มันมีชิ้นส่วนที่ชุบทองแดงที่ถูกทำเครื่องหมายลายแม็กม่าและคราบลายสีแดงโดยใช้โซเดียมคลอไรด์และความร้อนสูง พื้นที่ไม่มีเครื่องหมายถูกลงสีดำมืดผ่านออกซิเดชันโดยใช้กำมะถัน\n\nอัตราการเผาไหม้ของไฟ" },
	["am_turqoise_halftone"] = { name = "Cobalt Halftone", desc = "มันถูกลงสีด้วยลายแบบครึ่งสีขนาดใหญ่มากโดยใช้ฟิล์มลอยน้ำบนสีรองพื้นสีเขียวขุ่นเมทัลลิก\n\nฟีลิกซ์ นายกับฉันรู้กันอยู่ทั้งคู่แล้วว่าวาเลเรียกำลังจะประกาศทำสงคราม มีเพียงคำถามเดียวก็คือนายพร้อมแล้วหรือยัง? - นักค้าอาวุธ บูธ" },
	["cu_aug_chameleonaire"] = { name = "Chameleon", desc = "มันถูกลงสีแบบกำหนดเองด้วยรูปภาพของกิ้งก่า\n\nความละเอียดอ่อนก็สามารถสร้างความเปลี่ยนแปลงขึ้นได้" },
	["cu_ump_corporal"] = { name = "Corporal", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายทางทหาร\n\nความนับถือไม่สามารถถูกเอาไปได้ ต้องรับมาเท่านั้น" },
	["cu_p90_trigon"] = { name = "Trigon", desc = "มันถูกลงสีแบบกำหนดเองในสีส้ม เทา และดำที่ตัดกัน\n\nมนุษย์จะกลายมาเป็นพายุไต้ฝุ่น" },
	["cu_mac10_redhot"] = { name = "Heat", desc = "มันถูกลงสีแบบกำหนดเองโดยทำให้ดูเหมือนกับว่ามันเพิ่งออกมาจากเตาหลอม\n\nทำโครงร่างในแบบของคุณเอง" },
	["sp_negev_turq_terrain"] = { name = "Terrain", desc = "มันถูกลงสีด้วยลายสภาพภูมิประเทศโดยใช้ฟิล์มลอยน้ำ\n\nสำหรับใครบางคนที่ควรวางตัวเป็นกลาง ลูกสาวของคุณเป็นตัวเลือกที่น่าสนใจสำหรับมิตรภาพไมตรี - The Father and The Phoenix Part 1" },
	["cu_nova_antique"] = { name = "Antique", desc = "มันถูกลงสีด้วยรูปลอกแบบไม่ใช้น้ำเพื่อสร้างลายท่อนไม้และสลักสีทองโดยใช้การผสมของฟิล์มลอยน้ำ\n\nด้วยวัยที่มาพร้อมภูมิปัญญาและการหยุดของกำลัง" },
	["an_famas_sgt"] = { name = "Sergeant", desc = "มันถูกลงสีด้วยคราบสีในเชิงลึกโดยใช้น้ำยากั้นสีน้ำเพื่อสร้างลายทหาร และปิดทับด้วยการเคลือบเงาแบบด้าน\n\nนำเสนอโดยตัวอย่าง" },
	["cu_mag7_heaven"] = { name = "Heaven Guard", desc = "มันถูกลงสีด้วยรูปลอกแบบไม่ใช้น้ำด้วยลายปีกโดยใช้การผสมของลวดลายฟิล์มลอยน้ำอย่างละเอียด\n\nบางครั้งปีกของเทพธิดาไม่ได้มีความหมายว่าจะรอด" },
