	["hy_ssg08_marker"] = { name = "Detour", desc = "มันถูกตกแต่งด้วยปากกาเคมีบนสีรองพื้นสีขาว" },
	["am_royal"] = { name = "Chalice", desc = "มันถูกลงสีด้วยสีรองพื้นโครเมียมและลงสีแคนดี้ในสีน้ำเงินเข้มโปร่งแสงและสีเหลืองอำพันรูปแบบอโนไดซ์\n\nคุณเลือกอย่างชาญฉลาด" },
	["am_metals"] = { name = "Knight", desc = "มันมีแผ่นทองเหลืองปิดทับด้วยรูปแบบชุดเกราะเรอเนซองส์\n\nหมายความว่ายังไงที่คุณหาโคซิเนโรและอิซากิไม่เจอ? - ผู้บังคับบัญชาการ เฟลิกซ์ ไรลีย์" },
	["am_chainmail"] = { name = "Chainmail", desc = "มันถูกลงสีด้วยลายเกราะโซ่ถักบนสีรองพื้นสีเงินโปร่งแสงโดยใช้ฟิล์มลอยน้ำ\n\nเหล่าสมาชิกของฟีนิกซ์ ไม่มีใครจงรักภักดีต่อวาเลเรียไปมากกว่า นาโอมิ บอดี้การ์ดของเธอ" },
	["aq_handcannon"] = { name = "Hand Cannon", desc = "มันมีส่วนที่เป็นทองเหลืองที่ถูกพาตินาด้วยกรดโดยได้รับแรงบันดาลใจจากปืนใหญ่ทองเหลืองโบราณ\n\nเตรียมพร้อมที่จะเผชิญกับขวากหนากจำนวนมากในการทดสอบที่จะมาถึง\n\n" },
	["am_metal_inlay"] = { name = "Dark Age", desc = "มันถูกลงสีด้วยสีเมทัลลิกมันถูกสลักลงไปด้วยเหล็กในแม่ลายยุคกลาง\n\nฉันจะฆ่าชู้รักของเธอ... บางทีนั่นอาจช่วยคุณซื้อเวลาอยู่กับวาเลเรีย - A Father's Love Part 2" },
	["hy_vines"] = { name = "Briar", desc = "มันถูกลงสีด้วยลายเถาวัลย์ม้วนขดและดอกไม้โดยใช้ฟิล์มลอยน้ำ\n\nจูบจากรักแท้ไม่สามารถช่วยคุณได้จากขวากหนาม" },
	["so_indigo"] = { name = "Royal Blue", desc = "มันถูกลงสีด้วยสีเดียวในสีคราม สีเลือดหมู และสีเทา\n\nคุณควรจะยิ้มบ้างนะ เฟลิกซ์ คุณอาจโชคดีกับสาว ๆ บ้าง ถ้าคุณไม่ดูเหมือนไอ้ซื่อบื้อตลอดเวลา - นักค้าอาวุธฝึกหัด อิโมเจน" },
	["so_indigo_and_grey"] = { name = "Indigo", desc = "มันถูกลงสีด้วยสีเดียวในสีคราม สีน้ำเงิน และสีเทา\n\nอเล็กซ์ คินเคด ฉันแน่ใจว่าคุณมีหลายคำถาม... กรุณาให้ฉันตอบคำถามคุณ - The Phoenix and The Storyteller Part 1" },
	["cu_well_traveled_ak47"] = { name = "Jet Set", desc = "ด้ามปืนของมันถูกหุ้มเอาไว้ด้วยหนังสีน้ำตาล อาวุธนี้เคยผ่านมาแล้วหลายเมือง\n\nทุกคนให้ความสนใจอย่างใกล้ชิดที่จะเชื่อมจุดและดูสิ่งที่เธอทำ เราไม่มีเวลามากมาหาคำตอบ... - A Father's Love Part 1" },
	["cu_green_leather"] = { name = "First Class", desc = "ด้ามปืนของมันถูกพันเอาไว้ด้วยหนังสีเขียว\n\nแต่ไม่รวมมิโมซ่า" },
	["cu_brown_leather_p90"] = { name = "Leather", desc = "ด้ามปืนของมันถูกพันเอาไว้ด้วยหนังสีน้ำตาล\n\nอย่ากังวลไป ความปลอดภัยนั้นผ่านมาตรฐาน TSA" },
	["cu_luggage_mac10"] = { name = "Commuter", desc = "มันถูกลงสีด้วยลายตารางหมากรุกโดยใช้ฟิล์มลอยน้ำและบางส่วนถูกหุ้มด้วยหนังจระเข้เทียม\n\nพวกมันกินเหยื่อแล้ว รีบไปกันเถอะ... - ทหารรับจ้าง เอลเลียต คิงส์แมน" },
	["cu_medieval_dragon_awp"] = { name = "Dragon Lore", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายมังกรถักเชือก \n\nกุญแจ 200 ดอกก็ไม่สามารถปลดล็อคความลับมันได้" },
	["cu_luggage_p2000"] = { name = "Coach Class", desc = "มันถูกลงสีด้วยลายตารางหมากรุกโดยใช้ฟิล์มลอยน้ำและส่วนประกอบที่ด้ามจับถูกพันเอาไว้ด้วยหนังสีน้ำตาล\n\nมันไม่หรูหรา แต่มันพาคุณไปที่ที่คุณอยากจะไป" },
	["aq_pilot_deagle"] = { name = "Pilot", desc = "มันมีทองเหลืองที่ถูกฝังลงไปด้วยลายปีกของนักบิน\n\nรองรับการปะทะ" },
	["cu_leather_xm1014"] = { name = "Red Leather", desc = "ด้ามปืนและด้ามจับของมันได้ถูกพันเอาไว้ด้วยหนังสีแดง\n\nหยิบกระเป๋าของคุณ แล้วไปฆ่าไอ้ลูกหมานั่นกันเถอะ... - The Oni and The Valkyrie Part 2" },
	["cu_luggage_sg553"] = { name = "Traveler", desc = "มันถูกลงสีแบบกำหนดเองด้วยแถบลายออกแบบโดยได้รับแรงบันดาลใจจากกระเป๋าเดินทางแนววินเทจ และมีบางส่วนที่ถูกพันเอาไว้ด้วยหนังสีน้ำตาล\n\nทุกคนมีเรื่องราว และ Javier จะเปิดเผยมันออกมาก่อนเขาจะฆ่าคุณ" },
	["cu_luggage_usp-s"] = { name = "Business Class", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีและลายโดยได้รับแรงบันดาลใจจากกระเป๋าเดินทางแนววินเทจ และมีบางส่วนที่ถูกพันเอาไว้ด้วยหนังสีน้ำตาล\n\nบางคนอาจจะไม่เพียงแค่ต้องการที่เหยียดขา... พวกเขาต้องการความสงบและเงียบด้วย" },
	["hy_plaid1"] = { name = "Olive Plaid", desc = "มันถูกลงสีด้วยลายตารางหมากรุกในสีน้ำตาลอมเหลืองและสีเขียวเข้มอมเหลือง\n\nฉันชอบมัน มันนำพานัยน์ตาฉันบนลำกล้อง... - ดาวรุ่ง โรน่า ซาบรี" },
	["chy_plaid2"] = { name = "Green Plaid", desc = "chy_plaid2" },
	["cu_m4a1-s_silence"] = { name = "Master Piece", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายกราฟฟิตี้แบบ Wildstyle" },
	["cu_panther_ak47"] = { name = "Jaguar", desc = "มันถูกลงสีแบบกำหนดเองด้วยรูปภาพของเสือดำบนพื้นหลังลายพรางเสือ" },
	["cu_bratatat_negev"] = { name = "Bratatat", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายอักษรเสียงประกอบการ์ตูนและรูกระสุน" },
	["am_nuclear_pattern1_glock"] = { name = "Reactor", desc = "มันถูกลงสีด้วยสัญลักษณ์เตือนนิวเคลียร์โดยใช้สีเมทัลลิก" },
