	["sp_nuclear_pattern3_negev"] = { name = "Nuclear Waste", desc = "มันถูกลงสีด้วยสัญลักษณ์เตือนนิวเคลียร์โดยใช้ฟิล์มลอยน้ำ" },
	["am_nuclear_skulls1_xm1014"] = { name = "Bone Machine", desc = "มันถูกลงสีด้วยโครเมียมจากนั้นทำการทับด้วยลายกะโหลกนิวเคลียร์และกระดูกแบบกึ่งโปร่งแสงโดยใช้ฟิล์มลอยน้ำ" },
	["am_nuclear_skulls2_famas"] = { name = "Styx", desc = "มันถูกลงสีด้วยสีโครเมียมจากนั้นทำการทับด้วยลายกะโหลกนิวเคลียร์และกระดูกแบบกึ่งโปร่งแสงโดยใช้ฟิล์มลอยน้ำ" },
	["am_nuclear_skulls3_mac10"] = { name = "Nuclear Garden", desc = "มันถูกลงสีด้วยสีโครเมียมจากนั้นทำการลงสีทับด้วยลายกะโหลกนิวเคลียร์และกระดูกโดยใช้ฟิล์มลอยน้ำ" },
	["hy_nuclear_skulls4_p250"] = { name = "Contamination", desc = "มันถูกลงสีด้วยลายกะโหลกนิวเคลียร์และกระดูกโดยใช้ฟิล์มลอยน้ำ" },
	["hy_nuclear_skulls5_tec9"] = { name = "Toxic", desc = "มันถูกลงสีด้วยลายกะโหลกนิวเคลียร์และกระดูกที่ดูฉูดฉาดโดยใช้ฟิล์มลอยน้ำ" },
	["so_grey_nuclear_green_bizon"] = { name = "Chemical Green", desc = "มันถูกลงสีด้วยสีเดียวในสีเทาและสีเขียวฉูดฉาด" },
	["so_grey_nuclear_orange_five_seven"] = { name = "Hot Shot", desc = "มันถูกลงสีด้วยสีเดียวในสีเทาอ่อนและสีเขียว" },
	["cu_cerbrus_galil"] = { name = "Cerberus", desc = "มันถูกลงสีแบบกำหนดเองด้วยการวาด Cerberus ตำนานเกี่ยวกับสุนัขสามหัวที่เป็นองครักษ์เฝ้าใต้พื้นโลก" },
	["cu_tribute_ak47"] = { name = "Wasteland Rebel", desc = "มันถูกลงสีให้ดูทุกข์ระทมแบบบล็อกพิมพ์และลงสีด้วยกราฟฟิตี้\n\nวันหนึ่งพวกเขาถามฉันว่า ฉันสู้ไปเพื่ออะไร และเมื่อพวกเขาได้ฟัง พวกเขาคงจะเข้าใจ - บอดี้การ์ดวาเลเรีย เจนเนอร์ นาโอมิ" },
	["aq_glock_coiled"] = { name = "Grinder", desc = "สไลด์โลหะได้ถูกลงสีด้วยการรวมลายฉลุและลงสีด้วยมือโดยการใช้สีน้ำมัน\n\nวิธีเดียวที่จะทำเพชรให้เป็นเม็ดคือใช้แรงดัน" },
	["am_g3sg1_murky"] = { name = "Murky", desc = "มันถูกอโนไดซ์จากนั้นลงสีจุดลายเสือดาวโดยใช้ฟิล์มลอยน้ำ\n\nมีสักสถานที่ที่มืดมิดให้คุณไปได้" },
	["aq_m4a1s_basilisk"] = { name = "Basilisk", desc = "มันถูกแกะสลักด้วยลายบาซิลิสก์\n\nมันไม่สุภาพที่จะเพ่งมอง แต่ว่าสงครามนั้นไม่ใช่ช่วงเวลาแห่งความรื่นรมย์" },
	["cu_m4a4_griffin"] = { name = "Griffin", desc = "มันถูกลงสีด้วยมือเป็นภาพของกริฟฟิน\n\nเฟลิกซ์คัดเลือกทีมของเขาจากโอเปอเรเตอร์ทั่วโลก... และในขณะที่คนถามเกี่ยวกับบุคลิกของพวกเขา พวกเขาไม่เคยถามเกี่ยวกับผลลัพธ์บ้างเลย" },
	["sp_mag7_firebitten"] = { name = "Firestarter", desc = "มันถูกลงสีด้วยสเปรย์พ่นเป็นชั้น ๆ ให้ดูมัวหมองเพื่อให้ได้รูปลักษณ์ของขอบการเผาไหม้\n\nมันมักจะเริ่มต้นด้วยประกายเล็ก ๆ เสมอ" },
	["cu_mp9_chevron"] = { name = "Dart", desc = "มันถูกลงสีด้วยรูปแบบลายเครื่องหมายรูปตัววีโดยใช้การจัดลายฟิล์มลอยน้ำ\n\nโยนตามเป้าพอและคุณอาจโยนโดนเป้าเองแหละ" },
	["aq_p250_cartel"] = { name = "Cartel", desc = "มันถูกแกะสลักด้วยรูปโครงกระดูก ดอกไม้ และงู\n\nหนึ่งการบีบลั่นไกในทุก ๆ เช้าได้เปลี่ยนเป็นวันแห่งความตาย" },
	["cu_p2000_fire_elemental"] = { name = "Fire Elemental", desc = "มันถูกลงสีแบบกำหนดเองด้วยรูปของสัตว์ในรูปแบบกราฟฟิกที่ทำมาจากไฟ\n\nบางครั้งการเล่นกับไฟก็เป็นสิ่งที่ดี" },
	["aq_sawedoff_blackgold"] = { name = "Highwayman", desc = "มันถูกเคลือบเงาด้วยสีดำและสีทองลายสก๊อตทิสเทิล\n\nนายไม่ต้องคานิ้วก้อยชี้ออกมา เวลาเมื่อตอนกำลังลั่นไกหรอก แต่มันก็เป็นท่าที่ดีนะ" },
	["cu_scar20_intervention"] = { name = "Cardiac", desc = "มันถูกใช้ความร้อนห่อด้วยไวนิลก่อนลงสีด้วยดีไซน์สีส้มและน้ำเงินที่ทันสมัย\n\nปี๊บ ปี๊บ ปี๊บบบบบบบบบ..." },
	["sp_ump45_d-visions"] = { name = "Delusion", desc = "มันถูกลงสีด้วยภาพดีไซน์หอยโข่ง\n\nคาร์โคซ่ากำลังเรียกอยู่" },
	["cu_xm1014_caritas"] = { name = "Tranquility", desc = "มันถูกลงสีด้วยมือพร้อมด้วยรูปภาพผู้หญิงผมยาว\n\nฉันไม่ได้มานี่เพื่อสิ่งที่ฉันต้องการ ฉันมาที่นี่เพื่อบางสิ่งที่ฉันอยากได้ - Imogen and The Oni Part 2" },
	["am_awp_glory"] = { name = "Man-o'-war", desc = "มันถูกลงสีด้วยสีรองพื้นเมทัลลิกสีน้ำเงินจากนั้นทำการลงสีด้วยมือด้วยสีทองลายหมุนวน\n\nให้ใครหันมามองก่อนค่อยสอยพวกเขา" },
	["cu_elites_urbanstorm"] = { name = "Urban Shock", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายพรางที่ดูเรียบร้อยและการเน้นสีฟ้า\n\nด้วยสายฟ้าที่มาพร้อมกับฟ้าผ่า" },
	["aq_deagle_naga"] = { name = "Naga", desc = "มันถูกแกะสลักด้วยแม่ลายของสัตว์ในตำนาน\n\nสัตว์ร้ายในตำนานของอินเดียรวมไปถึงสนามรบ" },
	["cu_galil_abrasion"] = { name = "Chatterbox", desc = "มันถูกลงสีด้วยมือและดูทุกข์ระทม หัวกะโหลกที่วาดลงบนฝุ่นที่ปกคลุมจะปรากฏเพื่อจ้อกแจ้ก เมื่อสายฟ้าถูกแลกเปลี่ยนมา\n\nคำพูดบอกคำกล่าวว่า เมื่อคุณหัวเราะ โลกก็จะหัวเราะกับคุณ... แต่เมื่อคนพูดมากหัวเราะ มันก็เหมือนการกรีดร้องเท่านั้น" },
	["cu_glock_deathtoll"] = { name = "Catacombs", desc = "มันถูกลงสีด้วยสีรองพื้นเงินเมทัลลิกทับด้วยรูปหัวกะโหลกโดยใช้ฟิล์มลอยน้ำ\n\nการข่มขู่คือรูปแบบการเยินยอที่จริงใจที่สุด" },
	["cu_m4a4_ancestral"] = { name = "龍王 (Dragon King)", desc = "มันถูกลงสีด้วยรูปภาพของมังกรในสีแดงและสีน้ำเงิน\n\nอาวุธที่ควรค่าแก่เจ้าแห่งวานร - นักค้าอาวุธ บูธ" },
	["cu_m249_sektor"] = { name = "System Lock", desc = "มันถูกลงสีแบบกำหนดเองด้วยการออกแบบแนวไซไฟ\n\nการยิงสนับสนุนไม่เคยดูดีขนาดนี้มาก่อน" },
	["am_mac10_malachite"] = { name = "Malachite", desc = "มันถูกลงสีด้วยสีเมทัลลิกและยังมีรูปแบบลายหยักโดยใช้เครื่องมือหวียาง\n\nสีสว่างซ่อนปืนด้วยวัตถุประสงค์มืดมิด" },
	["cu_mp9_deadly_poison"] = { name = "Deadly Poison", desc = "มันถูกลงสีแบบกำหนดเองด้วยรูปทรงเชิงมุมไดนามิคและมีลายแมงมุมเก๋ไก๋\n\nมันไม่ใช่หมาลอบกัดคนแรกที่จะฆ่าคุณ มันอีกตั้ง 29 คนที่กำลังจะตามมาอีกภายหลัง" },
	["cu_p250_mandala"] = { name = "Muertos", desc = "มันถูกลงสีแบบกำหนดด้วยลวดลายวงกลม\n\nนี่เป็นหนึ่งสิ่งที่แพร่หลายในประเพณีและเลือด" },
	["cu_sawedoff_deva"] = { name = "Serenity", desc = "มันถูกลงสีด้วยมือพร้อมด้วยรูปภาพของผู้หญิงมีปีก\n\nสันติสุขเป็นความหรูหราที่คนบางส่วนเท่านั้นจะสามารถครอบครองได้ - นักปฏิวัติ วาเลเรีย เจนเนอร์" },
	["aq_scar20_leak"] = { name = "Grotto", desc = "มันถูกลงสีด้วยสีน้ำเงินเมทัลลิกโดยใช้ฟองน้ำและแปรงทาสี\n\nผู้ก่อตั้งของซีซันคอร์ปอเรชันได้รับมอบหมายงานชิ้นหนึ่งหลังถูกช่วยเหลือโดย โคทาโร่ อิซากิ โอเปอเรเตอร์ที่มีชื่อเสียง" },
	["aq_xm1014_sigla"] = { name = "Quicksilver", desc = "มันถูกลงสีด้วยลายแผนที่ภูมิประเทศบนสีรองพื้นเงินเมทัลลิกโดยใช้ฟิล์มลอยน้ำโปร่งแสง\n\nบางครั้งคุณจำเป็นต้องมีองค์ประกอบที่ไม่แน่นอนเพื่อแก้ไขปัญหาของคุณ - ผู้เชี่ยวชาญการบุกทะลวง โคทาโร่ อิซากิ" },
	["an_tiger_orange"] = { name = "Tiger Tooth", desc = "มันถูกทำอโนไดซ์ด้วยสีส้มและแกะสลักด้วยมือในลายของเสือ\n\nเหมือนดั่งเสือที่มันหายาก... เหมือนดังเสือที่มันอันตราย..." },
	["am_marble_fade"] = { name = "Marble Fade", desc = "มันถูกลงสีด้วยสีดำและสีเงินเมทัลลิกโดยการทำสีลายหินอ่อนจากนั้นเคลือบสีแบบแคนดี้สามสี\n\nดาบถูกทำมาหลายสีสัน แต่ไม่ช้ามันก็ดูเป็นสีแดง" },
	["am_marbleized"] = { name = "Doppler", desc = "มันถูกลงสีด้วยสีดำและสีเงินเมทัลลิกโดยการทำสีลายหินอ่อนจากนั้นเคลือบสีแบบแคนดี้\n\nการหลงไหลไปในสีสันของมันรับประกันได้ว่ามีความร้ายแรงอย่างมาก" },
	["cu_ak47_mastery"] = { name = "Elite Build", desc = "It has been custom painted using a combination of hydrographics and careful stenciling and detailed with heat-transfer decals.\n\nTread softly Naomi...people in your line of work aren't known for their longevity - The Shield and The Serpent Part 2" },
	["aq_mp7_ultramodern"] = { name = "Armor Core", desc = "มันถูกลงสีด้วยสีน้ำมันดำและยังมีชิ้นส่วนเหล็กสแตนเลสแปะและสลักให้อีกด้วย\n\nอาวุธยอดเยี่ยมสำหรับโอเปอเรเตอร์ที่ให้คุณค่าความประณีตเป็นอย่างดีเช่นเดียวกับประสิทธิภาพในพลังการยิง - นักค้าอาวุธ บูธ" },
	["aq_awp_twine"] = { name = "Worm God", desc = "มันถูกลงสีด้วยภาพหัวกะโหลกและรากไม้โดยใช้การเคลือบสีที่มีความทนทานสูง\n\nรากไม้บางอย่าง คุณไม่อยากถือมันหรอก" },
	["am_bronze_sparkle"] = { name = "Bronze Deco", desc = "มันถูกลงสีด้วยรูปแบบลายอาร์ตเดคโคโดยใช้สีออโตโมทีฟเมทัลลิก\n\nทุกคนกำลังค้นหาเงินและทอง" },
	["aq_p250_contour"] = { name = "Valence", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีน้ำเงินทันสมัยและดีไซน์ด้วยสีเทาที่เติมเต็มส่วนรูปร่างของอาวุธ\n\nทักษะของคุณไม่ได้อยู่ในคำถาม ทัศนคติของคุณต่างหาก - The Teacher and The Iconoclast Part 1" },
	["cu_fiveseven_banana"] = { name = "Monkey Business", desc = "มันคือกล้วย\n\nบางครั้งมันก็ไม่เป็นไรในการเอาอาหารของคุณเองมาเล่น" },
	["cu_galil_eco"] = { name = "Eco", desc = "มันถูกลงสีด้วยสีขาวและเขียวและลงรายละเอียดด้วยรูปลอกใช้ความร้อน\n\nหากเงินถึงพอ พวกยอดฝีมือจะรับจ้างจัดการปัญหาใดก็ตามด้วยตัวของพวกเขาเอง" },
	["aq_famas_jinn"] = { name = "Djinn", desc = "มันถูกฝังด้วยทองคำและนิกเกิลและแกะสลักด้วยภาพของจิน\n\nโปรดระวังความปรารถนาของคุณ" },
