	["am_negev_glory"] = { name = "PaintKit_am_awp_glory_Tag", desc = "PaintKit_am_awp_glory" },
	["cu_mac10_neonrider"] = { name = "Neon Rider", desc = "มันถูกลงสีแบบกำหนดเองด้วยรูปภาพของนักซิ่งมรณะ\n\nอาวุธปืนแบบหนึ่งชิ้นกับที่เก็บกับดักแบบสองชิ้น" },
	["cu_sawedoff_origami"] = { name = "Origami", desc = "มันถูกลงสีแบบกำหนดเองด้วยการออกแบบที่ได้รับแรงบันดาลใจจากโอริกามิ\n\nมันต้องใช้เวลาเพื่อสร้างบางสิ่งที่สวยงาม แต่ใช้เวลาเพียงแค่ชั่วครู่เพื่อทำลายมัน" },
	["cu_cz75_precision"] = { name = "Pole Position", desc = "มันถูกลงสีแบบกำหนดเองด้วยธีมรถแข่งสีแดงและสีเทา\n\nเรามีโอกาสเพียงแค่ตอนนี้เท่านั้น มาเริ่มกันเลย - ผู้บังคับบัญชาการ เฟลิกซ์ ไรลีย์" },
	["am_ump_racer"] = { name = "Grand Prix", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายรถแข่งสมัยเก่า \n\nอย่าลืมหมวกกันน็อคของคุณล่ะ" },
