	["cu_chronos_g3sg1"] = { name = "Chronos", desc = "มันถูกตกแต่งด้วยภาพกลไลนาฬิกาด้วยฟิล์มลอยน้ำสีซึ่งทำให้เคลิบเคลิ้มและเน้นด้วยลูกลอกที่ถ่ายเทความร้อน\n\nถึงเวลา ทุกสิ่งก็เป็นไปได้" },
	["hy_hades"] = { name = "Hades", desc = "มันถูกลงสีด้วยลายหมวกเกราะชาวกรีกโบราณโดยใช้ฟิล์มลอยน้ำ\n\nถ้าเธอต้องการให้ฉันมาสัมภาษณ์ มันอาจจะมีวิธีการที่ง่ายกว่าจองคิว - The Shield and The Storyteller Part 2" },
	["hy_icarus"] = { name = "Icarus Fell", desc = "มันถูกลงสีด้วยขี้ผึ้งเหลวรอบลายดวงอาทิตย์โดยใช้ฟิล์มลอยน้ำแบบขนนก\n\nการทรยศของเทอร์เนอร์เป็นความผิดของฉันเอง... ฉันต้องทำเรื่องนี้ให้ถูกต้อง - สไนเปอร์ เซบาสเตียน เฮนเนเคต" },
	["cu_labyrinth"] = { name = "Minotaur's Labyrinth", desc = "มันถูกลงสีด้วยลายเขาวงกตแบบมีมิติโดยใช้ฟิล์มลอยน้ำ\n\nไม่มีทางหนีจากฉันได้หรอก" },
	["sp_labyrinth1"] = { name = "Asterion", desc = "มันถูกลงสีด้วยสเปรย์พร้อมลายฉลุของเขาวงกตแบบมีมิติ\n\nกษัตริย์ก็แค่มนุษย์... และมนุษย์ไม่ควรถูกบูชา - นักปฏิวัติ วาเลเรีย เจนเนอร์" },
	["sp_labyrinth2"] = { name = "Pathfinder", desc = "มันถูกลงสีด้วยสเปรย์พร้อมลายฉลุของเขาวงกตแบบมีมิติ\n\nโดยส่วนตัวแล้ว ฉันชอบของรุ่นที่ 4 มากกว่า แต่อย่างว่าลูกค้าถูกเสมอ - นักค้าอาวุธ บูธ" },
	["sp_labyrinth3"] = { name = "Daedalus", desc = "มันถูกลงสีด้วยสเปรย์พร้อมลายฉลุของเขาวงกตแบบมีมิติ\n\nอิโมเจน... หากพวกเขารู้ว่าคุณทำอะไรไว้ มันอาจทำให้เราเสียทุกอย่าง - A Family Affair Part 1" },
	["cu_medusa_awp"] = { name = "Medusa", desc = "มันถูกลงสีแบบกำหนดเองด้วยรูปภาพของกอร์กอน\n\nถ้าเจ้าเห็นข้า เจ้าก็ได้ตายไปแล้ว" },
	["gs_mother_of_pearl_elite"] = { name = "Duelist", desc = "มันถูกลงสีมุกที่ด้ามจับและเน้นลายสีดำทมิฬ\n\nไม่มีลูกกวาดรวมอยู่หรอกนะ" },
	["aa_pandora"] = { name = "Pandora's Box", desc = "มันถูกลงสีลายวิญญาณรูปการ์ตูนด้วยแปรงพ่นสี\n\nโลกเหมือนอยู่ในเปลวเพลิง แต่อย่างน้อยเราก็มีความหวัง" },
	["cu_poseidon"] = { name = "Poseidon", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพวาดของศึกระหว่างปลาคู่และโพไซดอน\n\nคนสามคมจะเก็บความลับได้ ถ้าอีกสองคนตายไปแล้ว" },
	["hy_zodiac1"] = { name = "Moon in Libra", desc = "มันถูกลงสีด้วยลายราศีโดยใช้ฟิล์มลอยน้ำ\n\nวันนี้เป็นวันดีที่จะค้นหาความโรแมนติกและฆ่าคู่แข่งของคุณ" },
	["hy_zodiac2"] = { name = "Sun in Leo", desc = "มันถูกลงสีด้วยลายราศีโดยใช้ฟิล์มลอยน้ำ\n\nมันเป็นเดือนที่หยาบ ๆ สำหรับศัตรูของคุณ" },
	["hy_zodiac3"] = { name = "Shipping Forecast", desc = "มันถูกลงสีด้วยลายราศีโดยใช้ฟิล์มลอยน้ำ\n\nใครจะรู้ว่าในอนาคตจะเกิดอะไร" },
	["so_khaki_green"] = { name = "Para Green", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีด้วยสีเขียวกากีและสีดำทึบ\n\nเขาไม่เคยเปลี่ยน เขาไม่เคยเป็น ไม่ต้องห่วงไปหรอก เฟลิกซ์... ฉันจะหยุดเขาเอง - The Paladin and The Teacher Part 2" },
	["cu_anime_aug"] = { name = "Akihabara Accept", desc = "มันถูกตกแต่งด้วยไวนิลถ่ายเทความร้อนรูปปกนิตยสารอนิเมะที่แม็กกาซีน\n\nสำเร็จแล้ว!" },
	["am_bamboo_jungle"] = { name = "Hydroponic", desc = "มันถูกลงสีด้วยลายไม้ไผ่โดยใช้สีเมทัลลิก\n\nสังเกตุได้ว่าช่างทำปืน ยูคาโกะ ได้ใช้ไม้ของปืน AK-47 เพื่อเน้นธีมเขียวขจีของเธอ... เพื่อไม่ให้เกิดข้อผิดพลาด: Hydroponic เป็นปืนที่มีความสวยงามและเป็นธรรมชาติอย่างแท้จริงด้วยตัวของมันเอง - นักค้าอาวุธฝึกหัด อิโมเจน" },
	["hy_bamboo_jungle_ink"] = { name = "Bamboo Print", desc = "มันถูกลงสีด้วยลายไม้ไผ่โดยใช้ฟิล์มลอยน้ำ\n\nใส่คำว่าหน่อไม้ที่นี่" },
	["hy_bamboo_jungle_black"] = { name = "Bamboo Shadow", desc = "มันถูกลงสีด้วยลายไม้ไผ่โดยใช้ฟิล์มลอยน้ำ\n\nโคทาโร่สูญเสียลูกชายเขาให้กับปืนกระบอกนี้... และวันหนึ่งเขาจะใช้มันเพื่อหยุดคนที่ต้องรับผิดชอบ" },
	["hy_bamboo_jungle"] = { name = "Bamboo Forest", desc = "มันถูกลงสีด้วยลายไม้ไผ่โดยใช้ฟิล์มลอยน้ำ\n\nฉันยังคิดอยู่ว่าฉันควรมีหมีแพนด้าสักตัว - นักค้าอาวุธ บูธ" },
	["am_geometric_steps"] = { name = "Aqua Terrace", desc = "มันถูกลงสีด้วยสีเมทัลลิกลายรูปทรงเรขาคณิต\n\nตอนนี้เงียบสงบแล้ว..." },
	["hy_geometric_steps"] = { name = "Geo Steps", desc = "มันถูกลงสีด้วยลายรูปทรงเรขาคณิตโดยใช้ฟิล์มลอยน้ำ" },
	["hy_geometric_steps_green"] = { name = "Counter Terrace", desc = "มันถูกลงสีด้วยลายรูปทรงเรขาคณิตโดยใช้ฟิล์มลอยน้ำ\n\nเฮ้ ซาบรี คุณควรเอานี้ไปสักอันสิ... มันเสียงดังอย่างที่คุณชอบเลยละ - ผู้เชี่ยวชาญการแทรกซึม คาร์เมน โคซิเนโร" },
	["hy_geometric_steps_yellow"] = { name = "Terrace", desc = "มันถูกลงสีด้วยลายเรขาคณิตโดยใช้ฟิล์มลอยน้ำ\n\nคุณเชื่อใจวาเลเรียเกินไป... มันอาจจะทำให้คุณถูกฆ่าได้นะ - นักวางกลยุทธ์ฟีนิกซ์ ฟรานซ์ ครีเกลด์" },
	["hy_kimono_diamonds"] = { name = "Neon Kimono", desc = "มันถูกลงสีด้วยลายเรขาคณิตโดยใช้ฟิล์มลอยน้ำ\n\nฉันรู้ ฉันขอคุณมากไป... เทอร์เนอร์ก็เหมือนลูกชายของคุณ - The Paladin and The Teacher Part 1" },
	["hy_kimono_diamonds_orange"] = { name = "Orange Kimono", desc = "มันถูกลงสีด้วยลายเรขาคณิตโดยใช้ฟิล์มลอยน้ำ\n\nประเพณีเป็นสิ่งที่ทรงพลัง" },
	["hy_kimono_diamonds_red"] = { name = "Crimson Kimono", desc = "มันถูกลงสีด้วยลายรูปทรงเรขาคณิตโดยใช้ฟิล์มลอยน้ำ\n\nเทอร์เนอร์ มนุษย์ทุกคนสามารถถูกทำลายได้... มันเป็นแค่เรื่องของการหาเหตุผลความกดดันที่ถูกต้อง - The Traitor and The Truthseeker Part 2" },
	["sp_kimono_diamonds"] = { name = "Mint Kimono", desc = "มันถูกลงสีด้วยสเปรย์พ่นด้วยลายรูปทรงเรขาคณิต\n\nมาเถอะ บูธ ให้ฉันแสดงให้นายดูว่าฉันกำลังทำอะไรอยู่ - ช่างทำปืน ยูคาโกะ" },
	["am_seastorm"] = { name = "Midnight Storm", desc = "มันถูกลงสีด้วยลายทะเลที่มีพายุบนสีรองพื้นสีน้ำเงินเมทัลลิกโดยใช้ฟิล์มลอยน้ำ\n\nฉันไม่ได้เกลียดนายนะ เซบาสเตียน... ฉันสงสารนาย - ผู้แปรพักตร์จากโคลิชัน เชส เทอร์เนอร์" },
	["am_seastorm_blood"] = { name = "Sunset Storm 壱", desc = "มันถูกลงสีด้วยลายทะเลที่มีพายุบนสีรองพื้นสีแดงเมทัลลิกโดยใช้ฟิล์มลอยน้ำ\n\nคุณก็คิดเหมือนกันสินะ แต่พอดูอีกครั้ง... ความละเอียดอ่อนที่ทำมันต่างกันโดยสิ้นเชิง" },
	["am_seastorm_shojo"] = { name = "Sunset Storm 弐", desc = "am_seastorm_shojo" },
	["am_kimono_sunrise"] = { name = "Daybreak", desc = "มันถูกลงสีด้วยลายพระอาทิตย์ขึ้นโดยใช้สีเมทัลลิก\n\nพระอาทิตย์ขึ้นบางทีก็ยุติธรรมและไม่ยุติธรรมเหมือนกัน" },
	["am_so_keycolors"] = { name = "Impact Drill", desc = "am_so_keycolors" },
	["so_aqua"] = { name = "Seabird", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีด้วยสีอควอและสีแทน\n\nกับระเบิด" },
	["cu_ak47_courage_alt"] = { name = "Aquamarine Revenge", desc = "มันถูกลงสีแบบกำหนดเองด้วยรูปภาพของฝูงปลาโลมา\n\nมีเสียงสะท้อนอยู่ที่นี่ด้วยหรือ?" },
	["cu_cz75a_chastizer"] = { name = "Yellow Jacket", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายรูปร่างคดโค้ง\n\nล่องลอยเหมือนผีเสื้อ แต่ต่อยเหมือนแมลงจงเกลียดจงชังไม่หยุดหย่อน" },
	["am_famas_dots"] = { name = "Neural Net", desc = "มันถูกลงสีด้วยสีรองพื้นเมทัลลิกโดยใช้ฟิล์มลอยน้ำโปร่งแสง\n\nฉันรู้ แต่มันเป็นสิ่งถูกต้องที่ต้องทำ... - A Family Affair Part 2" },
	["cu_galilar_particles"] = { name = "Rocket Pop", desc = "มันถูกลงสีแบบกำหนดเองด้วยการออกแบบกราฟิกของลายเส้นและละอองลายพิกเซล\n\nสิ่งที่ดีที่สุดสำหรับวันฤดูร้อน" },
	["aq_glock18_flames_blue"] = { name = "Bunsen Burner", desc = "มันถูกลงสีคราบลายสีน้ำเงินซึ่งถูกขัดส่วนของตัวสไลด์เพื่อออกแบบเป็นกราฟฟิคเปลวไฟ\n\nก็อก ก็อก" },
	["cu_m4a4_evil_daimyo"] = { name = "Evil Daimyo", desc = "มันถูกลงสีแบบกำหนดเองด้วยการออกแบบกราฟิกในสีแดงและสีดำ\n\nคาร์เมน ฉันพบเขาแล้ว...- The Oni and The Valkyrie Part 1" },
	["cu_mp7_nemsis"] = { name = "Nemesis", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพปีศาจเมทัลลิก\n\nมันกำลังมาหาคุณ" },
	["am_mp9_nitrogen"] = { name = "Ruby Poison Dart", desc = "มันถูกลงสีด้วยสีแดงและสีม่วงเมทัลลิกบนสีรองพื้นสีดำ\n\nใครเป็นคนพูดว่าเพชรเป็นเพื่อนที่ดีที่สุดของหญิงสาวกันแน่?" },
	["cu_negev_annihilator"] = { name = "Loudmouth", desc = "มันถูกลงสีแบบกำหนดเองด้วยดีไซน์ความน่ากลัวและความทุกข์ทรมาน\n\nกลับมาที่นี่อีก ฉันเก็บแกแน่!" },
	["cu_nova_ranger"] = { name = "Ranger", desc = "มันถูกลงสีด้วยการลงรายละเอียดด้วยรูปลอกใช้ความร้อนโดยใช้ฟิล์มลอยน้ำแบบรอยพู่กัน\n\nใครกำลังเก็บแต้มอยู่?" },
	["aq_p2000_boom"] = { name = "Handgun", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายท่าทางการเล็งยิงด้วยการทำด้วยมือ\n\nความสนุกและเกมไม่มีอีกแล้ว" },
	["cu_ump45_uproar"] = { name = "Riot", desc = "มันถูกลงสีด้วยรูปลอกใช้ความร้อนโดยใช้การผสมของฟิล์มลอยน้ำ\n\nถ้าคุณไม่ได้อยากได้ค่าประกันความเสียหาย บางทีคุณควรบอกเฉพาะเจาะจงกว่านี้นะ... - กำปั้นแห่งฟีนิกซ์ ฮาเวียร์ อัลวิโซ" },
	["cu_usp_progressiv"] = { name = "Torque", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีดำทันสมัยและออกแบบลายด้วยสีขาวและสีเหลือง\n\nพวกมันกำลังมาจัดการนายแล้ว โคทาโร่ และถ้านายไม่เห็นพวกนั้น นายกำลังงานเข้ามากกว่าที่นายรู้ซะอีก... - ผู้บังคับบัญชาการ เฟลิกซ์ ไรลีย์" },
	["cu_ak47_winter_sport"] = { name = "Frontside Misty", desc = "มันถูกลงสีด้วยสีอาร์กติกสดใส\n\nฉันชอบทำงานในที่มีหิมะ... มันมักจะถ่ายรูปออกมาได้สวยเสมอ - กำปั้นแห่งฟีนิกซ์ ฮาเวียร์ อัลวิโซ" },
	["cu_dualberretta_dragons"] = { name = "Dualing Dragons", desc = "มันถูกแกะสลักเลเซอร์รูปมังกรบนสไลด์และด้าม\n\nแมเรียนมักเย็นกว่าซิลเวีย" },
	["cu_famas_lenta"] = { name = "Survivor Z", desc = "มันถูกฉลุโดยการใช้แผ่นเทปปิดคลุมให้ดูมัวหมอง\n\nสีแดงและสีขาวและยิงอัตโนมัติเต็มรูปแบบคืออะไร?" },
	["gs_g3sg1_flux_purple"] = { name = "Flux", desc = "มันถูกลงสีด้วยสีม่วงและสีเงินเมทัลลิก\n\nแผนคือรายการของสิ่งที่ไม่เกิดขึ้น" },
	["gs_galil_nightwing"] = { name = "Stone Cold", desc = "มันถูกเน้นด้วยสีน้ำเงินเมทัลลิก ด้ามและแม็กกาซีนปืนถูกทำเครื่องหมายโดยผู้ออกแบบ\n\nในที่สุดคุณต้องก้าวออกจากเงาของผู้ให้คำปรึกษาของคุณ" },
	["gs_glock18_wrathys"] = { name = "Wraiths", desc = "มันถูกลงสีแบบกำหนดเองด้วยรูปวิญญาณที่สูญเสียบนสไลด์\n\nครั้งแรกมันทะลุผ้าห่อศพ จากนั้นมันก็ทะลุเงา" },
	["gs_m249_nebula_crusader"] = { name = "Nebula Crusader", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายดูเหมือนตู้อาร์เคดคลาสสิก\n\nคุณสามารถใช้มันได้ แต่คุณจะใช้ได้ดีเมื่อผ่านไปสามเดือนแรก" },
	["gs_m4a1s_snakebite_gold"] = { name = "Golden Coil", desc = "มันถูกลงสีด้วยลายงูที่กำลังจู่โจมโดยใช้ฟิล์มลอยน้ำ\n\nงูเหลือมจู่โจมได้จากทุกที่" },
	["cu_mac10_alekhya_duo"] = { name = "Rangeen", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายชาวอียิปต์โบราณ\n\nคุณยืนทนการจ้องมองที่มีแต่ความโกรธแค้นได้ไหมละ?" },
	["cu_mag7_myrcene"] = { name = "Cobalt Core", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายออกแบบกราฟิกที่เหลือเชื่อ\n\nปกป้องเขาให้ปลอดภัยละ คาร์เมน - The Valkyrie and The Paramour Part 1" },
	["cu_mp7_classified"] = { name = "Special Delivery", desc = "มันถูก -แก้ไขแล้ว-\n\nถ้าฉันทำอย่างที่คุณต้องการ คุณจะปล่อยฉันไปไหมละ? - The Phoenix and The Storyteller Part 2" },
	["hy_p250_crackshot"] = { name = "Wingshot", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีสันสดใสโดยใช้ฟิล์มลอยน้ำ\n\nบางครั้งการขัดเกลาอย่างพิถีพิถันก็ใช้เวลาเพื่อให้ได้สิ่งที่คุณต้องการ - นักวางกลยุทธ์ฟีนิกซ์ ฟรานซ์ ครีเกลด์" },
	["gs_scar20_peacemaker03"] = { name = "Green Marine", desc = "มันถูกลงสีด้วยสีเมทัลลิกรูปแบบลายพราง\n\nฟังนะ ทุกคน... อิซากิและโคซิเนโรอาจจะไปตามเส้นทางชีวิต แต่ภารกิจของเรายังคงเหมือนเดิม: พวกเราจะทำการช่วยเหลืออเล็กซ์ คินเคด - ผู้บังคับบัญชาการ เฟลิกซ์ ไรลีย์" },
	["cu_ssg08_technicality"] = { name = "Big Iron", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีเหลืองและสีส้มมัวหมองเล็กน้อยโดยใช้ฟิล์มลอยน้ำ\n\nชัยชนะที่มีเครื่องหมายดอกจันก็ยังคงเป็นชัยชนะอยู่ดี - ดาวรุ่ง โรน่า ซาบรี" },
	["cu_usp_kill_confirmed"] = { name = "Kill Confirmed", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพกระสุนทะลุหัวกะโหลก\n\n2 นัดในอก 1 นัดในหัว" },
	["aq_xm1014_scumbria"] = { name = "Scumbria", desc = "มันถูกลงสีอย่างพิถีพิถันด้วยสีเมทัลลิก\n\nอย่ารีบร้อน: อาจมีวิธีอื่นที่จะทำให้วาเลเรียให้ความสนใจ... - A Father's Love Part 3" },
	["cu_ak47_point_disarray"] = { name = "Point Disarray", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายเรขาคณิตโดยใช้ฟิล์มลอยน้ำ\n\nความใกล้ชิดคือความโกลาหล...จากระยะห่างของความสวยงาม - นักวางกลยุทธ์ฟีนิกซ์ ฟรานซ์ ครีเกลด์" },
	["am_aug_jumble"] = { name = "Ricochet", desc = "มันถูกลงสีแบบตกแต่งเองด้วยรูปแบบลายถักเชือกสีสองโทน\n\nKotaro ไม่ต้องการการปกป้องจากพวกเรา - The Valkyrie and The Paramour Part 2" },
	["cu_bizon_noxious"] = { name = "Fuel Rod", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายลวงตาของกระสุนรังสี\nบางครั้งการแสดงความไม่พอใจต้องยกมือขึ้น" },
	["aq_deagle_corinthian"] = { name = "Corinthian", desc = "มันถูกแกะสลักเลเซอร์และลงลายหนังด้ามแบบกำหนดเอง\n\nปกป้อง ความหวัง เชื่อมั่น พากเพียร" },
	["cu_fiveseven_retrobution"] = { name = "Retrobution", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายเรโทรโดยใช้ฟิล์มลอยน้ำ\n\nบางอย่างก็ไม่เคยออกจากสไตล์ได้" },
	["cu_g3sg1_executioner"] = { name = "The Executioner", desc = "มันถูกลงสีด้วยมือพร้อมด้วยลายรูปกระดูกน่ากลัว\n\nฉันมักจะได้ถ้วยรางวัลตลอด - กำปั้นแห่งฟีนิกซ์ ฮาเวียร์ อัลวิโซ" },
	["gs_m4a4_royal_squire"] = { name = "Royal Paladin", desc = "มันถูกแกะสลักอย่างพิถีพิถันและลงสีเพื่อให้สัมผัสได้ถึงความหรูหรา\n\nตู้โทรศัพท์นี้ไม่เคยเกิดขึ้นมา คุณเข้าใจหรือเปล่า? - The Paladin and the Father Part 1" },
	["cu_negev_impact"] = { name = "Power Loader", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายที่ชวนให้คิดถึงรถตักเครื่องจักรกลหนักโดยใช้ฟิล์มลอยน้ำ\n\nความน่าเกรงขามสร้างโดยราชนี ความอันเป็นที่รักภักดีสร้างโดยบิชอป" },
	["am_p2000_imperial_red"] = { name = "Imperial", desc = "มันถูกแกะสลักด้วยเลเซอร์และลงสีด้วยสีแดงและสีเหลืองเมทัลลิก\n\nความรู้สึกของผมมันไม่จำเป็น ลูกพี่ ผมมีจักรวรรดิที่ต้องปกป้องอยู่ - นักค้าอาวุธ บูธ" },
	["cu_p90_shapewood"] = { name = "Shapewood", desc = "ด้ามไม้ถูกแกะสลัก ขัด และลงลามิเนทด้วยมือ\n\nไม่มีแหนบแถมมาให้" },
	["gs_sawedoff_necromancer"] = { name = "Yorick", desc = "มันถูกลงสีด้วยรูปหัวกะโหลกโดยใช้ฟิล์มลอยน้ำและลงสีด้วยมือด้วยสีทอง\n\nโรเซนแครนซ์และกิลเดนสเตอร์ไม่เคยได้มีโอกาส..." },
	["hy_scar20_jungler"] = { name = "Outbreak", desc = "มันถูกลงสีด้วยเฉดสีเขียวสดใส\n\nวาเลเรียเริ่มกล้าบ้าบิ่นแล้ว... ถึงเวลาที่ต้องสู้กับเธอเสียที - ผู้บังคับบัญชาการ เฟลิกซ์ ไรลีย์" },
	["gs_sg553_tiger_moth"] = { name = "Tiger Moth", desc = "มันถูกลงสีแบบกำหนดเองด้วยรูปแบบลายปีกของแมลง\n\nวาเลเรียเริ่มกล้าบ้าบิ่นแล้ว... ถึงเวลาที่ต้องสู้กับเธอเสียที - ผู้บังคับบัญชาการ เฟลิกซ์ ไรลีย์" },
	["cu_tec9_avalanche"] = { name = "Avalanche", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายที่ทันสมัยและลายเกี่ยวกับอนาคตโดยใช้ฟิล์มลอยน้ำ\n\nเราต้องฉลาดเวลาก้าวเข้าไปปะทะกับเธอ ถ้าก้าวพลาดไปเพียงครั้งเดียว เธอจะเข้ามาขยี้เราทั้งคู่ได้ - The Serpent and the Truth Seeker" },
	["aq_xm1014_hot_rod"] = { name = "Teclu Burner", desc = "มันถูกลงสีเมทัลลิกเพื่อเพิ่มลายเปลวไฟ\n\nบางครั้งการแผดเผาก็คงไม่พอ..." },
	["gs_ak47_supercharged"] = { name = "Fuel Injector", desc = "ตัวปืนไรเฟิลได้ถูกลงสีเหลืองสดใสและแม็กกาซีนได้ถูกลงสีแบบกำหนดเองให้ดูเหมือนเครื่องจักรกล\n\nใช้ชีวิตในเศษหนึ่งส่วนสี่แม็กต่อครั้ง" },
	["cu_bizon_citizen"] = { name = "Photic Zone", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายพรางพร้อมเน้นสีด้วยสีเรืองแสง\n\nนั่นไม่ใช่คลื่นกระแทกที่คุณได้ยิน..." },
	["aq_deserteagle_kumichodragon"] = { name = "Kumicho Dragon", desc = "มังกรได้ถูกแกะสลักด้วยเลเซอร์บนสไลด์ปืนและด้ามจับ\n\nฉันเป็นแฟนตัวยงของผลงานยูคาโกะ เราควรคุยกันได้แล้ว... - ผู้แข่งขัน ฮักซ์ลีย์" },
	["cu_fiveseven_augmented"] = { name = "Triumvirate", desc = "มันถูกลงสีฟ้าใสด้วยฟิล์มลอยน้ำ DDPAT และลงสีสไลด์ปืนแบบกำหนดเอง\n\nฉันไม่ได้กำไรจากสงคราม ฉันได้กำไรจากเงื่อนไขของพวกมนุษย์... - นักค้าอาวุธ บูธ" },
	["gs_glock18_award"] = { name = "Royal Legion", desc = "มันถูกแกะสลักอย่างประณีต\n\nนาโอมิเข้าใจว่าวันหนึ่ง เธอจะตายเพื่อวาเลเรีย" },
	["gs_m4a4_pioneer"] = { name = "The Battlestar", desc = "มุมทั้งหมดได้ถูกตัดออกด้วยใบเสร็จรับเงินจากการสั่งซื้อ\n\nระวังผู้ที่พูดถึงหอสังเกตการณ์" },
	["am_mac10_electricity"] = { name = "Lapis Gator", desc = "มันถูกลงสีลวดลายจระเข้สีสดใจด้วยฟิล์มลอยน้ำ\n\nไม่มีเรือลมรวมอยู่" },
	["gs_mag7_praetorian"] = { name = "Praetorian", desc = "มันถูกลงสีแบบจำแนกความแตกต่างด้วยสีเมทัลลิก\n\nหน่อกำลังจะขึ้นรูป" },
	["sp_mp7_impire"] = { name = "Impire", desc = "มันถูกลงสีรูปลายฝูงอิมด้วยฟิล์มลายน้ำ\n\nการสังหารไม่เคยน่ารัก" },
	["cu_ssg08_necropos"] = { name = "Necropos", desc = "มันถูกลงสีด้วยมือพร้อมด้วยรูปอักขระที่ร้ายกาจ\n\nช่างไม้ทุกคนต้องการค้อนของพวกเขา ช่างตัดเสื้อทุกคนก็ต้องการเครื่องปั่นจักรเย็บผ้าเช่นกัน..." },
	["gs_tec9_jambiya"] = { name = "Jambiya", desc = "มันถูกลงสีด้วยมือพร้อมด้วยเลเซอร์แกะสลักรูปแบบลายตะวันออกกลาง\n\nชาห์ราดเล่านิทาน 1000 เรื่อง... นี่เป็นเรื่องสุดท้ายที่คุณจะได้ยิน" },
	["gs_usp_voltage"] = { name = "Lead Conduit", desc = "มันถูกแกะสลักแบบกำหนดเองที่ปลอกเก็บเสียงและสไลด์ปืน\n\nคุณได้สิ่งที่คุณต้องการ ตอนนี้คุณรู้ใช่ไหมว่ามันหมายความว่าไง? – นักค้าอาวุธ บูธ" },
	["cu_aug_swallows"] = { name = "Fleet Flock", desc = "มันถูกลงสีลายนกที่กำลังบินผ่านก้อนเมฆด้วยฟิล์มลอยน้ำ\n\nนกโอมเป็นตัวแทนของความสามัคคีและความสงบสุข... นกเหล่านั้นไม่ใช่นกเหล่านี้" },
	["cu_bizon_Curse"] = { name = "Judgement of Anubis", desc = "มันถูกลงสีแบบกำหนดเองด้วยธีมลายอียิปต์\n\nไกปืนน้ำหนักมันเบากว่าขนนกซะอีก" },
	["gs_cz75a_redastor"] = { name = "Red Astor", desc = "มันถูกลงสีด้วยมือพร้อมด้วยลายสีแดงและเน้นสีขาว\n\nบูธเป็นคนที่ใกล้เคียงกับพวกที่มีครอบครัวดราม่า และใครจะบ้ามาดราม่าขณะที่เรากำลังคุยเรื่องธุรกิจกันอยู่ - ผู้แข่งขัน ฮักซ์ลีย์" },
	["gs_dualberettas_ventilators"] = { name = "Ventilators", desc = "ปืนพกเหล่านี้ถูกลงสีโครเมียนอย่างประณีต\n\nอาวุธสำหรับศิลปิน ทำโดยศิลปิน" },
	["sp_g3sg1_militiaorange"] = { name = "Orange Crash", desc = "ลายฉลุและสเปรย์สีส้มทำให้ปืนไรเฟิลนี้ดูเหมือนมีลายเซ็น\n\nกลายเป็นวันที่ทันสมัยสำหรับแชร์คาน" },
	["gs_galilar_incenerator"] = { name = "Firefight", desc = "มันถูกลงสีเน้นด้วยสีแดงเข้มและลงสีด้วยมือเป็นรูปไอคอน\n\nบูธมีงานรับผิดชอบอาวุธพวกนี้ของวาเลเรียเพื่อพยายามทำเรื่องราบรื่นกับฟีนิกซ์" },
	["cu_m249_spectre"] = { name = "Spectre", desc = "มันถูกลงสีด้วยลายมันเงาและรูปลักษณะที่ร่วมสมัย\n\nสงครามกลางเมืองของฟีนิกซ์ใกล้จะเริ่มต้นแล้ว" },
	["cu_m4a1s_soultaker"] = { name = "Chantico's Fire", desc = "มันถูกลงสีด้วยมือพร้อมด้วยสีสดใสและเน้นโดยลายใบหน้ายิ้มแย้มบนด้ามปืน\n\nปกป้องสิ่งที่เป็นของคุณ" },
	["am_mp9_bioleak"] = { name = "Bioleak", desc = "เฉดสีเขียวที่แตกต่างกันสร้างภาพลวงตาการรั่วไหลของสารเคมี\n\nระวังได้รับสารพิษโดยตรง" },
	["hy_p2000_oceani"] = { name = "Oceanic", desc = "มันถูกลงสีด้วยสีรองพื้นสีดำจากนั้นเน้นด้วยดีไซน์สีฟ้า\n\nมีใครได้ยินเรื่องจากโคทาโร่หรือคาร์เมนบ้างไหม? - ผู้บังคับบัญชาการ เฟลิกซ์ ไรลีย์" },
	["cu_p250_asiimov"] = { name = "Asiimov", desc = "มันถูกลงสีแบบกำหนดเองด้วยดีไซน์แนวไซไฟ\n\nหากคุณคิดว่าฉันอยากได้ไรเฟิลเพื่อฆ่าคน คุณไม่รู้หรอกว่าคุณกำลังพูดอยู่กับใคร... - สไนเปอร์ฟีนิกซ์ มิคาห์ บิตัน" },
	["gs_sawedoff_fubar"] = { name = "Fubar", desc = "ปืนลูกซองที่ใช้งานมาเป็นอย่างดีจะมีเครื่องหมายติ๊กขีดอยู่บนตัวปืน\n\nเริ่มต้นด้วยเสียงปัง... จบลงด้วยเสียงเงียบ" },
	["cu_sg553_atlas"] = { name = "Atlas", desc = "มันถูกลงสีลายพรางสมัยใหม่ด้วยฟิล์มลอยน้ำ\n\nครั้งหนึ่งเคยเป็นโครงการที่จัดสรรให้กับหน่วยงานเฉพาะกิจโคลิชัน แต่ฮักซ์ลีย์เข้าร่วมในหน่วยสืบราชการลับเพื่อจัดการพวกฟีนิกซ์" },
	["gs_ssg08_armacore"] = { name = "Ghost Crusader", desc = "มันถูกลงสีด้วยสีขาวและยังมีการเน้นสีน้ำเงินอาร์กติกให้อีกด้วย\n\nฉันไม่สามารถทดแทนสิ่งที่ถูกเอาจากเราไปได้... แต่ฉันสามารถเอาคืนจากพวกมันได้มากกว่า - The Phoenix and The Initiate Part 2" },
	["am_tec9_redblast"] = { name = "Re-Entry", desc = "ลำกล้องถูกลงสีด้วยลายรูปเปลวไฟ\n\nฉันไม่ชอบมันมาตลอด - ผู้เชี่ยวชาญการแทรกซึม คาร์เมน โคซิเนโร" },
	["cu_ump45_primalsaber"] = { name = "Primal Saber", desc = "มันถูกลงสีรูปลอกหัวกะโหลกเสือเขี้ยวดาบ\n\nนักล่าทุกคนท้ายที่สุดก็พบกับจุดจบ" },
	["cu_xm1014_spectrum"] = { name = "Black Tie", desc = "วิสัยทัศน์การมองเห็นในสีดำและโครเมียมสีขาว ทำให้ปืนลูกซองกระบอกนี้ใช้ได้ดีที่สุดในช่วงโอกาสที่เป็นทางการ\n\nเราได้ตัวอิซากิและโคซิเนโรแล้ว คุณจำเป็นใช้พวกเขาเพื่อบางอย่าง หรืออยากให้ฉันฆ่าพวกเขาทิ้งตอนนี้เลยละ? - The Mercenary and The Serpent Part 1" },
	["cu_lore"] = { name = "Lore", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายถักเชือก" },
	["cu_stonewash"] = { name = "Black Laminate", desc = "มันถูกเอาไปฝนกับหินและให้ด้ามจับแบบลามิเนตสีดำมา" },
	["am_marbleized_g"] = { name = "Gamma Doppler", desc = "มันถูกลงสีด้วยสีดำและสีเงินเมทัลลิกโดยการทำสีลายหินอ่อนจากนั้นเคลือบสีแบบแคนดี้" },
	["gs_autotronic"] = { name = "Autotronic", desc = "มันถูกอโนไดซ์ให้ได้สีแดงและใช้ลวดเหล็กตาข่ายเพื่อให้น้ำหนักเบาขึ้น" },
	["am_marked_up"] = { name = "Freehand", desc = "มันถูกลงสีด้วยสีดำและม่วง จากนั้นตกแต่งด้วยเครื่องหมายแบบเมทัลลิก" },
	["gs_aug_aristocrat"] = { name = "Aristocrat", desc = "มันมีลวดลายปักสีเงินอย่างละเอียดบนพื้นสีฟ้ารูปแบบอโนไดซ์\n\nสำหรับ 1%" },
	["gs_awp_phobos"] = { name = "Phobos", desc = "มันถูกสร้างขึ้นจากแผงโลหะและชิ้นส่วนอิเล็กทรอนิกส์ที่ทนทาน\n\nสร้างโลกให้ดีขึ้น" },
	["cu_five_seven_daimyo"] = { name = "Violent Daimyo", desc = "มันถูกลงสีแบบกำหนดเองด้วยดีไซน์กราฟิกสีม่วงและสีดำ\n\nคุณจะปกครองอย่างไร?" },
	["cu_glock_wasteland_rebel"] = { name = "Wasteland Rebel", desc = "มันถูกลงสีให้ดูทุกข์ระทมแบบบล็อกพิมพ์และลงสีด้วยกราฟฟิตี้\n\nจ่ายส่วย" },
	["gs_m4a1_mecha_industries"] = { name = "Mecha Industries", desc = "มันถูกสร้างขึ้นจากแผงเซรามิกแข็ง\n\nคุณสมบัติเทคโนโลยีใหม่ล่าสุด" },
	["cu_m4a4_desolate_space"] = { name = "Desolate Space", desc = "มันถูกลงสีแบบกำหนดเองด้วยแนวธีมอวกาศ\n\n\"เราสูญเสียการติดต่อแล้ว\"" },
	["aq_mac_10_alien_camo"] = { name = "Carnivore", desc = "มันถูกลงสีด้วยสีแดงและสีม่วงโดยใช้ฟิล์มลอยน้ำบนสีรองพื้นเมทัลลิก\n\nจงเตรียมพร้อมก่อนเสิร์ฟ" },
	["aq_nova_sci_fi"] = { name = "Exo", desc = "มันถูกลงสีด้วยลายโดยใช้ฟิล์มลอยน้ำ รูปแบบแผ่นสีเงินเหนือพื้นผิวสีม่วง\n\nอะไรเป็นสิ่งที่อยู่ภายในให้นับ" },
	["gs_p2000_imperial_dragon"] = { name = "Imperial Dragon", desc = "มันถูกลงสีแบบตกแต่งเองด้วยลักษณะของมังกรโดยลงสีด้วยสีแดงเมทัลลิก\n\nมองไปทางทิศตะวันตกสิ" },
	["gs_p250_metal_panels"] = { name = "Iron Clad", desc = "มันถูกตกแต่งด้วยหมุดโลหะตอกประดับ\n\nขอรับประกันความน่าเชื่อถือและความปลอดภัย" },
	["gs_p90_full_throttle"] = { name = "Chopper", desc = "มันถูกลงสีด้วยรูปแบบเปลวไฟในสีส้มและสีน้ำเงินเมทัลลิก\n\nไม่รวมคลัตช์" },
	["gs_pp_bizon_harvester"] = { name = "Harvester", desc = "มันถูกตกแต่งไปด้วยรูปแบบของเครื่องจักรกลชีวภาพ\n\nการทดลองทางชีวกลศาสตร์เป็นไปในทิศทางที่ถูกต้อง" },
	["cu_r8_cybersport"] = { name = "Reboot", desc = "มันถูกตกแต่งด้วยการเน้นสีแดงบนสีเงินและสีดำ\n\n\"คุณได้ลองปิดและเปิดใหม่หรือยัง?\"" },
	["cu_sawed_off_lime"] = { name = "Limelight", desc = "มันถูกลงสีแบบตกแต่งเองด้วยโค้งที่โฉบเฉี่ยวในสีเขียวสะท้อนแสงและลงสีขาว\n\nตาทั้งหมดจ้องมองที่คุณ" },
	["gs_scar20_bloodsport"] = { name = "Bloodsport", desc = "มันถูกคลุมไปด้วยสติกเกอร์โลโก้สีขาวบนฟิล์มลอยน้ำสีแดงและสีดำ\n\nฝ่ายผู้ต่อต้านผู้ก่อการร้ายได้รับการสนับสนุนโดย…" },
	["cu_sg553_aerial"] = { name = "Aerial", desc = "มันถูกลงสีด้วยสีเงินและเหลือง แล้วยังมีปีกสีขาวมาให้อีกด้วย\n\nสร้างอากาศที่เหนือกว่าขึ้นมาสิ" },
	["am_tec_9_sea_salt"] = { name = "Ice Cap", desc = "มันถูกลงสีด้วยสีฟ้าและขาวนามธรรมแบบใช้ฟิล์มลอยน้ำ\n\nยุบฝ่ายคัดค้านซะ" },
	["bloodhound_black_silver"] = { name = "Charred", desc = "มันถูกสร้างขึ้นมาจากหนังนิ่มสีดำคลาสสิก\n\nเหรียญการท้าทายมันก็ดี แต่พวกเขาไม่ปาดเลือดกันเมื่อเวลาคุณอัดกำปั้นหลังใส่ใครสักคน - ผู้เชี่ยวชาญการแทรกซึม คาร์เมน โคซิเนโร" },
	["bloodhound_snakeskin_brass"] = { name = "Snakebite", desc = "มันถูกสร้างขึ้นด้วยส่วนผสมของผ้าหนังและหนังงู\n\nมาพูดกันตรง ๆ นะ... ไม่มีใครคิดถึงเซอร์เกเลย - นักวางกลยุทธ์ฟีนิกซ์ ฟรานซ์ ครีเกลด์" },
	["bloodhound_metallic"] = { name = "Bronzed", desc = "หนังถูกย้อมด้วยโลหะปืนและทองแดง\n\nปฏิบัติการ Bloodhound หมายหัวจุดจบของมือปืนสไนเปอร์เชส เทอร์เนอร์คนทรยศ" },
	["bloodhound_guerrilla"] = { name = "Guerrilla", desc = "มันถูกสร้างขึ้นด้วยส่วนผสมของหนังสีน้ำตาลและหนังสังเคราะห์ที่มีการพิมพ์ลายคาโม่\n\nวาเลเรียวางแผนที่จะแก้แค้นอย่างไม่มีข้อสงสัยแน่นอน... - สไนเปอร์ เซบาสเตียน เฮนเนเคต" },
	["handwrap_leathery"] = { name = "Leather", desc = "มันถูกทำมาจากหนัง ผ้าพันแผล และเจตนาทำร้ายร่างกาย\n\nจงกลายเป็นที่ฉาวโฉ่" },
	["handwrap_camo_grey"] = { name = "Spruce DDPAT", desc = "ห่อภายนอกด้วยผ้าสกีนลงสีลายคาโม่ดิจิทัลเทา\n\nบางคนบอกว่าพวกเขากำลังลำบาก ... คนอื่น ๆ ก็แสดงมันให้เห็น" },
	["handwrap_red_slaughter"] = { name = "Slaughter", desc = "สีแดงเข้มที่ห่อด้วยผ้าเหล่านี้ ทำให้ยากต่อการดูว่าผ้าจะเสียและมีคราบเลือดเมื่อไร\n\nใครไม่ชอบการทำงานด้วยมือบ้างละ?" },
	["handwrap_fabric_orange_camo"] = { name = "Badlands", desc = "ถุงมือป้องกัน DIY นี้ ทำจากวัสดุที่ยังเหลือใช้\n\nเฟลิกซ์จับตาดูการวางมวยตีกันที่ไม่ได้รับอนุญาตในหน่วยเฉพาะกิจโคลิชัน" },
	["slick_black"] = { name = "Lunar Weave", desc = "หนังนิ่มสีน้ำเงินมิดไนท์ถูกผสานเข้ากับหนังดำเพื่อให้ถุงมือเหล่านี้ดูไม่เก่าตามกาลเวลา\n\nเอาเลือดออกจากมือ...มักเป็นการพูดเชิงเปรียบเทียบ" },
	["slick_military"] = { name = "Convoy", desc = "มันถูกทำด้วยหนังนิ่มสีน้ำตาลผสมกันและย้อมสี\n\nบางครั้งก็ควรได้รับการพิจารณา" },
	["slick_red"] = { name = "Crimson Weave", desc = "หนังนิ่มสีดำถูกผสานเข้ากับหนังสีแดงเข้มเพื่อให้ถุงมือเหล่านี้ดูไม่เก่าตามกาลเวลา\n\nทิ้งเครื่องหมายของนายไว้ ไม่ใช่ทิ้งลายนิ้วมือเอาไว้" },
	["slick_snakeskin_yellow"] = { name = "Diamondback", desc = "มันถูกสร้างขึ้นจากการผสมหนังสีน้ำตาล หนังสีดำ และหนังงู\n\nปัญหาธรรมดาสำหรับผู้ห่วยแตก... - นักค้าอาวุธฝึกหัด อิโมเจน" },
	["sporty_green"] = { name = "Hedge Maze", desc = "ถุงมือสีเขียวและสีขาวถูกผลิตขึ้นโดย Icarus Athletics\n\nเฉพาะคนขี้ขลาดที่กลัวการบินใกล้ดวงอาทิตย์" },
	["sporty_purple"] = { name = "Pandora's Box", desc = "ถุงมือสีดำและสีม่วงมีลายที่ละเอียดอ่อนที่พิมพ์บนฝ่ามือ\n\nต้องมีสำหรับผู้เชี่ยวชาญด้านการทำลายล้างด้วยฝ่ามือที่เปื้อนเหงื่อ" },
	["sporty_light_blue"] = { name = "Superconductor", desc = "ถุงมือสีน้ำเงินและสีดำในอุดมคติที่เหมาะอย่างยิ่งสำหรับผู้ที่ต้องการความมหัศจรรย์\n\nพวกเขาไม่ต้องการมี" },
	["sporty_military"] = { name = "Arid", desc = "ลายหลายเฉดสีน้ำตาลและลายพิมพ์คาโม่แบบละเอียด ทำให้ถุงมือเหล่านี้มีลักษณะโดดเด่น\n\nถ้าเรากำลังจะเป็นวีรบุรุษ เราก็อาจทำให้ดูดีเป็นส่วนหนึ่ง... - ดาวรุ่ง โรน่า ซาบรี" },
	["specialist_ddpat_green_camo"] = { name = "Forest DDPAT", desc = "หนังเย็บด้วยมือได้ถูกจับคู่กับผ้าพิมพ์ที่ทนทาน DDPAT\n\nบางคนไม่ชอบที่ทำให้มือพวกเขาเองสกปรก" },
	["specialist_kimono_diamonds_red"] = { name = "Crimson Kimono", desc = "ถุงมือสีดำคู่นี้ได้รับการเน้นด้วยลายเพชรสีแดงเข้ม\n\nเริ่มเห็นสีแดง" },
	["specialist_emerald_web"] = { name = "Emerald Web", desc = "ด้านหลังของถุงมือได้ถูกลงลายใยแมงมุม\n\nกฏระเบียบก่อให้เกิดความสำเร็จ" },
	["specialist_white_orange_grey"] = { name = "Foundation", desc = "ถุงมือสีขาวและดำนี้ถูกเน้นด้วยสีส้ม\n\nมีข่าวลือว่า Tortue ได้รับแรงบันดาลใจจากอาวุธปืน Asiimov" },
	["motorcycle_basic_black"] = { name = "Eclipse", desc = "นี่คือการออกแบบสีดำแบบดั้งเดิมที่ทำให้ Tortue เป็นชื่อที่ใช้ในครัวเรือน\n\nอย่าเรียกว่าวิกฤติกลางชีวิต" },
	["motorcycle_mono_boom"] = { name = "Boom!", desc = "ถุงมือคู่นี้ได้รับการคุมด้วยหนังสือการ์ตูน Onomatopoeia\n\nเป้า! ตูม! ฟิ้ว!" },
	["motorcycle_mint_triangle"] = { name = "Spearmint", desc = "หนังสีขาวและเย็บด้วยด้ายสีแดง ทำให้ถุงมือเหล่านี้ดูทันสมัยสะดวกสบาย\n\nสำหรับสิ่งที่เขาเรียกเก็บเงินเรา คุณคิดว่าคนอย่างฮักซ์ลีย์จะคิดอย่างน้อยเหมือนโยนเม็ดลูกอมมินต์หรือไง... - ผู้บังคับบัญชาการ เฟลิกซ์ ไรลีย์" },
	["motorcycle_triangle_blue"] = { name = "Cool Mint", desc = "ถุงมือหนังสีฟ้าอ่อนได้รับการเน้นด้วยการออกแบบทางเรขาคณิตแบบอาร์กติก\n\nการสู้รบไม่เคยทำให้รู้สึกสดชื่น" },
	["slick_snakeskin_white"] = { name = "King Snake", desc = "มันถูกสร้างขึ้นจากหนังสีขาวและผิวหนังงู" },
	["slick_plaid_purple"] = { name = "Imperial Plaid", desc = "ถุงมือผ้ากำมะหยี่และติดผ้าหนังคู่นี้ได้ถูกลงสีอิมพีเรียล" },
	["slick_stitched_black_orange"] = { name = "Overtake", desc = "ความเร็วเป็นแก่นแท้สำหรับถุงมือสีดำคลาสสิกและหนังสีแทนคู่นี้" },
	["slick_slick_stitched_green_grey"] = { name = "Racing Green", desc = "ถุงมือสีเขียวคู่นี้ได้ถูกเน้นด้วยหนังสีเทาทอด้วยผ้าพร้อมลายเชฟรอน" },
	["sporty_poison_frog_blue_white"] = { name = "Amphibious", desc = "ถุงมือสีฟ้าและสีขาวใยสังเคราะห์คู่นี้จะแห้งและระบายอากาศได้อย่างรวดเร็ว" },
