	["motorcycle_trigrid_blue"] = { name = "Polygon", desc = "มันถูกสร้างขึ้นจากส่วนผสมของวัตถุที่มนุษย์สร้างขึ้นและติดหนังสีน้ำเงินเฉดสีต่าง ๆ" },
	["handwrap_leathery_fabric_blue_skulls"] = { name = "Cobalt Skulls", desc = "ผ้ากุ๊นพันมือสีฟ้าคู่นี้ถูกพิมพ์ด้วยลายหัวกะโหลก" },
