	["handwrap_leathery_ducttape"] = { name = "Duct Tape", desc = "ผ้าพันมือจากขยะเหลือใช้คู่นี้ทนทานอย่างไม่น่าเชื่อ แต่ระบายอากาศได้ไม่ดี" },
