	["bloodhound_hydra_case_hardened"] = { name = "Case Hardened", desc = "ถุงมือหนังมังสวิรัติคู่นี้ได้ถูกพิมพ์ด้วยลายเมทัลลิกที่มีสีสันแตกต่างกัน" },
