	["cu_AK47_Anarchy"] = { name = "Neon Revolution", desc = "มันถูกลงสีรูปลอกแบบผสมผสานด้วยฟิล์มลายน้ำจากนั้นก็หยดสีลงไป\n\nไม่มีหน่วยพลีชีพไหนทำสำเร็จได้ถ้าไม่มีมัน" },
	["gs_AUG_Syd_Mead"] = { name = "Syd Mead", desc = "มันถูกออกแบบกำหนดเองโดยศิลปินชื่อดัง Syd Mead\n\nในอดีต เขาให้วิสัยทัศน์ของอนาคตกับเรา ในปัจจุบัน เขาฝากอนาคตไว้ในมือของพวกเรา..." },
	["gs_CZ75_Tread"] = { name = "Imprint", desc = "มันถูกแกะสลักอย่างพิถีพิถันด้วยมือ\n\nอาวุธปืนถูกออกแบบที่สาธารณรัฐเช็กโดยสตรอม" },
	["aq_Desert_Eagle_Constable"] = { name = "Directive", desc = "มันถูกออกแบบเพื่อช่วยในการบังคับใช้กฎหมายในอนาคตเพื่อหยุดพวกครีป \n\nทีของคุณแล้ว..." },
	["gs_FAMAS_Rally"] = { name = "Roll Cage", desc = "มันถูกลงสีแบบกำหนดเองด้วยรูปลอกที่คล้ายกับรอยโคลนที่สาดโดนรถ\n\nปลอดภัยไว้ก่อน" },
	["aq_Five_Seven_Scumbria"] = { name = "Scumbria", desc = "มันถูกลงสีเป็นรอยริ้วซึ่งแยกกันอย่างสิ้นเชิง\n\nนายปล่อยเขาตายไม่ได้ เฟลิกซ์ นายต้องช่วยเขา - The Daughter and the Paladin Part 1" },
	["gs_G3SG1_Ventilator"] = { name = "Ventilator", desc = "มันถูกลงสีด้วยสีดำสง่างามและทาโครเมียมและด้ามปืนเป็นยางแบบกำหนดเอง\n\nอย่าห่วงไปเลย นาโอมิ ฉันจะทำให้เฟลิกซ์ต้องชดใช้ - สไนเปอร์ฟีนิกซ์ มิคาห์ บิตัน" },
	["cu_Glock18_Weasel"] = { name = "Weasel", desc = "มันถูกลงสีลายบ็อบบี้เจ้าพังพอนจอมซนด้วยฟิล์มลอยน้ำ อย่าซ่ากับบ็อบบี้ล่ะ\n\nเพียงเพราะเขาน่ารัก ไม่ได้หมายความว่าเขาจะไม่กัด" },
	["cu_MAG7_Tribal"] = { name = "Petroglyph", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพลายตาของหินแกะสลัก\n\nความขัดแย้งมันมีมาตั้งแต่มนุษย์ถ้ำยุคแรก เริ่มเรียนรู้วิธีการหยิบก้อนหินมาใช้แล้ว – นักค้าอาวุธ บูธ" },
	["cu_MP9_Narcis"] = { name = "Airlock", desc = "มันถูกลงสีด้วยสีขาวและยังมีแมกกาซีนสีแดงเข้มให้อีกด้วย\n\nยอดเยี่ยมสำหรับการยิงเครื่องปิ้งขนมปัง" },
	["hy_Negev_Dazzle"] = { name = "Dazzle", desc = "มันถูกคลุมไปด้วยสติกเกอร์ลายม้าลายสีน้ำเงินและขาว\n\nในที่สุด ปืนสำหรับคนรักไม่ใช่เรื่องสำคัญ" },
	["cu_P90_Grimm"] = { name = "Grim", desc = "มันถูกลงสีลายผีที่ถูกฆาตกรรมด้วยฟิล์มลอยน้ำ จากนั้นแปรงปัดแห้งเน้นสีเขียว\n\nอิโมเจน... เธอกำลังขายปืนให้ฉันหรือโปสเตอร์กำมะหยี่กันแน่เนี่ย? – ดาวรุ่ง โรน่า ซาบรี" },
	["gs_SCAR20_Powercore"] = { name = "Powercore", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีเขียวเน้นด้วยสีเหลืองและยังมีรหัส USB สำหรับชำระเงินทันทีให้อีกด้วย\n\nกฎข้อที่ 1 – ความท้าทายต้องการความพึงพอใจ" },
	["cu_SG556_Triarch"] = { name = "Triarch", desc = "ปืนไรเฟิลนี้ได้รับการว่าจ้างโดยราชวงศ์และถูกลงสีแบบกำหนดเองด้วยลายคาโม่ทะเลทราย\n\nเตือนใจพวกเขาด้วยความรักของคุณ" },
	["gs_TEC9_Supercharged"] = { name = "Fuel Injector", desc = "ตัวปืนได้ถูกลงสีเหลืองและแม็กกาซีนได้ถูกลงลายเครื่องจักรด้วยฟิล์มลอยน้ำ ด้ามหนังจับนี้ถูกทำอย่างดีด้วยซีแอตเติลคลาสสิก\n\nไม่รวมลูกมือมาให้" },
	["cu_UMP45_Metritera"] = { name = "Briefing", desc = "มันถูกลงสีลายแผนที่ภูมิประเทศด้วยฟิล์มลอยน้ำ\n\nนี่คงเป็นการพบกันที่สั้นน่าดู..." },
	["hy_XM1014_Fractal_Blue"] = { name = "Slipstream", desc = "มันถูกลงสีแบบกำหนดเองด้วยควันสีเทาและสีฟ้าสดใส\n\nอดทนไว้ เอลเลียต พวกเขายังคงมีบทบาทที่ต้องเล่น... - The Mercenary and The Serpent Part 2" },
	["am_czv2_mf"] = { name = "Polymer", desc = "สไลด์ปืนได้ถูกทำเป็นลูกลอกที่คล้ายครึงกับสูตรโพลีเมอร์\n\nคุณต้องไม่ค้าขายกับพวกฟีนิกซ์ไปมากกว่านี้ เรารู้วิธีดูแลตัวของเราเองได้... - The Daughter and the Paladin Part 2" },
	["aq_glock_dark-fall"] = { name = "Ironwork", desc = "สไลด์ปืนได้ถูกแกะสลักเลเซอร์เป็นรูปไม้เลื้อยและหนาม\n\nหากไม่ได้รับตรวจ สวนใด ๆ ก็กลายเป็นแหล่งยุ่งเหยิงของวัชพืชได้" },
	["cu_ssg08_dragonfire_scope"] = { name = "Dragonfire", desc = "มันถูกลงสีด้วยลายมังกรขนาดใหญ่หายใจเป็นไฟโดยใช้ฟิล์มลอยน้ำ\n\nนั่งเฝ้าอยู่บนสมบัติของคุณและรอคอยใครสักคนมาเอามันไป" },
	["gs_dual_berettas_golden_venice"] = { name = "Royal Consorts", desc = "ระหว่างสองด้ามจับทำด้วยมุกย้อมสีเขียว แผงข้างมีรูปกริฟฟอนและแกะสลักลายด้วยเลเซอร์ ปืนพกเหล่านี้คือนิยามใหม่แห่งความสง่างาม\n\nเผชิญหน้าและปล่อยนกพิราบ" },
	["gs_famas_mecha"] = { name = "Mecha Industries", desc = "งานออกแบบสีขาวและสีดำ ทำให้รู้สึกเหมือนมันมาจากหนังไซไฟ\n\nผมตั้งสีฟ้าและไม่มีหุ่นยนต์เป็นเพื่อนรวมอยู่" },
	["gs_final_pooldeadv2"] = { name = "Cirrus", desc = "มันถูกลงสีด้วยสีน้ำเงินโลหะและยังมีรูปหัวกะโหลกให้อีกด้วย\n\nเอาหัวของคุณออกจากก้อนเมฆซะ" },
	["gs_g3sg1_viper_yellow"] = { name = "Stinger", desc = "มันถูกลงสีด้วยสีเหลืองและเน้นด้วยสีเทา\n\nช่วงเวลาแห่งความเจ็บปวด มันไม่มีค่าอะไรเลย" },
	["cu_galil_ar-camo"] = { name = "Black Sand", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีดำและลายพรางทหาร\n\nมิคาฮ์ บาตัน เริ่มต้นเกี่ยวกับการรณรงค์ต่อต้านหน่วยเฉพาะกิจโคลิชัน" },
	["aa_hide-mp9"] = { name = "Sand Scale", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีเทาและน้ำตาล\n\nเราต้องเตรียมพร้อมสำหรับการแก้แค้น - ผู้บังคับบัญชาการ เฟลิกซ์ ไรลีย์" },
	["cu_m4a1_flashback"] = { name = "Flashback", desc = "มันถูกลงสีด้วยมือพร้อมความพยายามเพื่อแนะนำเกี่ยวกับความเป็นคู่ของมนุษย์\n\nสำหรับเรื่องตลกทั้งหลายของเรา" },
	["gs_m4a4_sector"] = { name = "Buzz Kill", desc = "อาวุธของ Sektor Industry นี้ถูกลงสีด้วยสีเหลืองและสีเขียว\n\nมันมีอยู่ทุกปาร์ตี้" },
	["am_mag7_malform"] = { name = "Sonar", desc = "มันถูกลงสีด้วยลายฉลุสีฟ้าเขียวอ่อน\n\nคุณพูดถูก การแพ้เป็นประสบการณ์ใหม่สำหรับฉันเลย – The Oni and The Valkyrie Part 2" },
	["am_nova_sand"] = { name = "Gila", desc = "มันถูกคลุมด้วยสติกเกอร์ลายกิ้งก่า\n\nคุณทำเหมือนคุณไม่เคยถูกจับตัวโดยทหารรับจ้างมาก่อน – The Oni and The Valkyrie Part 1" },
	["gs_p2000-sport"] = { name = "Turf", desc = "ด้ามจับและสไลด์ถูกลงสีด้วยสีเขียวเมทัลลิก\n\nสนามหญ้ามักมีรอยแดงบนฝั่งตรงข้ามเสมอ" },
	["gs_p90_shallow_grave"] = { name = "Shallow Grave", desc = "ด้ามจับถูกลงสีด้วยลายคล้ายหินรูนอักขระโบราณและลงสีที่ด้ามจับด้วยลายโครงกระดูกโดยใช้ฟิล์มลอยน้ำ\n\nด้วยจำนวนศพที่นายหิ้งมาขนาดนี้ ใครจะเป็นคนไปขุดดินละ?" },
	["cu_usp_cyrex"] = { name = "Cyrex", desc = "มันถูกลงสีด้วยไฮไลท์สีแดงอย่างรอบคอบเพื่อให้ความรู้สึกที่เหนือคำบรรยาย\n\nอิโมเจนเคยเป็นอดีตของเฟลิกซ์ แต่ฉันคืออนาคต - ผู้แข่งขัน ฮักซ์ลีย์" },
	["cu_wp_sawedoff"] = { name = "Wasteland Princess", desc = "บางคนมีการเก็บติดตามจำนวนการสังหารไว้ที่รังเพลิง\n\nของขวัญที่สมบรูณ์แบบสำหรับพวกโรคจิตนั้นมีทุกอย่าง..." },
	["gs_ak47_bloodsport"] = { name = "Bloodsport", desc = "มันถูกคลุมไปด้วยสติกเกอร์โลโก้สีขาวบนฟิล์มลอยน้ำสีแดงและดำ \n\nนักขับร่วมมือกัน ผู้เป็นที่ต้องการตัว" },
	["cu_awp_psychopath"] = { name = "Fever Dream", desc = " มันถูกลงสีแบบกำหนดเองด้วยสีชมพู น้ำเงิน และม่วง วาดเป็นลายภาพอยู่บนพื้นสีดำ\n\nความคุ้มคลั่งเป็นสิ่งที่อันตราย" },
	["hy_bizon_torn_green"] = { name = "Jungle Slipstream", desc = " มันถูกลงสีแบบกำหนดเองด้วยสีเขียวและเหลืองโดยใช้ฟิล์มลอยน้ำ\n\nติดตามผู้นำไป" },
	["cu_blueprint_scar"] = { name = "Blueprint", desc = " มันถูกลงสีด้วยมือโดยใช้ธีมสีน้ำเงินซึ่งมีลักษณะคล้ายกับพิมพ์เขียวของสถาปนิก\n\nการวางแบบแปลนที่ดีที่สุดคือการวาดให้แบบแปลนมีขนาดสัดส่วน" },
	["gs_cz_snakes_purple"] = { name = "Xiangliu", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีม่วงเก้ายอดและลายงูสีทองที่ถูกลงสีไว้\n\nจงระวังน้ำขึ้นให้ดี" },
	["gs_m4a1_decimator"] = { name = "Decimator", desc = "มันถูกลงสีแบบกำหนดเองด้วยไฮไลท์สีฟ้าและสีชมพูที่ดูรุนแรงอย่างสิ้นเชิง\n\nความเงียบงันของเรโทรแนวอนาคต" },
	["cu_desert_eagle_corroden"] = { name = "Oxide Blaze", desc = " มันถูกลงสีแบบกำหนดเองด้วยรองพื้นสีสนิมและลงรายละเอียดสีขาว\n\nไม่มีอะไรที่กระดาษทรายชิ้นน้อยแก้ไม่ได้" },
	["cu_fiveseven_vein"] = { name = "Capillary", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายเส้นเลือดดำที่ประกอบด้วยสีเขียวฟ้าที่ดูสลับซับซ้อนและลายแนวปะการัง\n\n20 มากกว่า 100" },
	["sp_galil_wave"] = { name = "Crimson Tsunami", desc = "มันถูกลงสีด้วยสเปรย์ลายคลื่นสีน้ำเงินอยู่บนสีรองพื้นน้ำตาลแดง\n\nจอมทำลายทิศตะวันตก" },
	["sp_m249_frog_original"] = { name = "Emerald Poison Dart", desc = " มันถูกลงสีด้วยลายกบลูกศรพิษโดยใช้ฟิล์มลอยน้ำ\n\nการอนุรักษ์ไม่ใช่สิ่งสำคัญ" },
	["sp_mp7_tribal_yellow"] = { name = "Akoben", desc = "มันถูกลงสีด้วยสเปรย์ลายสีน้ำเงินทับบนสีรองพื้นสีเหลือง\n\nจงกู่ร้องออกศึกในแบบตัวของคุณเอง" },
	["am_p250_sputnik"] = { name = "Ripple", desc = "มันถูกลงสีด้วยลายสีฟ้าเทาโดยถูกอโนไดซ์ทับบนสีรองพื้นสีดำ\n\nจงกลายเป็นก้อนกรวดซะ" },
	["aa_mac10_the_last_dive"] = { name = "Last Dive", desc = "มันถูกลงสีด้วยมือโดยใช้ลายสีเขียวและสีส้มแบบสุ่ม\n\nจงมีความงดงามในความวุ่นวาย" },
	["gs_ump_abyss"] = { name = "Scaffold", desc = "มันถูกลงสีด้วยมือโดยใช้สีเขียวฟ้าและลงรายละเอียดเอฟเฟกต์เชิงลึก\n\nอิฐมักต่อด้วยอิฐ" },
	["cu_usps_noir"] = { name = "Neo-Noir", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายผู้หญิงสีน้ำเงินผสมสีม่วงแดงเข้มที่ดูทันสมัยบนสีรองพื้นโทนสีเทา\n\n\"เธอเปียกโชกเหงื่อในท่ามกลางแสงไฟนีออน เธอย่างเท้าสู่ตึกระฟ้าด้วยความกดดัน\"" },
	["aq_xm_leaf_fade"] = { name = "Seasons", desc = " มันถูกลงสีด้วยมือโดยใช้ลายใบไม้หลากสีแบบสุ่ม\n\nฤดูใบไม้ผลิ ฤดูร้อน ฤดูใบไม้ร่วง และฤดูหนาวช่างหาได้ยากยิ่ง" },
	["aq_sawedoff_zander2"] = { name = "Zander", desc = "มันถูกลงสีด้วยมือให้คล้ายกับเกมปลายอดนิยม\n\nสิ่งนี้เป็นของที่ต้องรักษา" },
	["hy_p90_barebones_blue"] = { name = "Death Grip", desc = "มันถูกลงสีด้วยรูปภาพมือที่ทับซ้อนกันโดยใช้ฟิล์มลอยน้ำทับลงบนสีรองพื้นสีฟ้า\n\nอย่าไปเงียบ ๆ" },
	["cu_usps_blueprint"] = { name = "Blueprint", desc = "มันถูกลงสีด้วยมือโดยใช้ธีมสีน้ำเงินที่คล้ายกับแบบแปลนของสถาปนิก\n\nบางครั้งการวางแบบแปลนที่ดีที่สุดมักจะเบี้ยวไม่เป็นท่า" },
	["gs_ak_colony01_red"] = { name = "Orbit Mk01", desc = "มันถูกลงสีด้วยมือพร้อมดีไซน์สีแดงและสีดำ\n\nกู้คืนจาก COLONY01" },
	["gs_dualberettas_cobra"] = { name = "Cobra Strike", desc = "ภาพงูเห่าได้ถูกลงสีด้วยมือบนด้ามจับ สไลด์ปืนแสดงสีนีออนวีนอม\n\nพวกมันมักจู่โจมกลับเสมอ" },
	["sp_famas_macabre"] = { name = "Macabre", desc = "มันถูกลงสีด้วยสเปรย์ลายดีไซน์สีเขียวทับบนสีเหลืองที่เคลือบทับไว้ด้านล่าง\n\nการค้นพบที่น่าสยดสยอง" },
	["cu_fiveseven_hyperbeast"] = { name = "Hyper Beast", desc = "มันถูกลงสีแบบกำหนดเองด้วยรูปสัตว์ร้ายในสีสันฉูดฉาด\n\nเราทุกคนล้วนเป็นปีศาจ" },
	["cu_galil_candychaos"] = { name = "Sugar Rush", desc = "มันถูกลงสีแบบกำหนดเองโดยใช้สีธีมขนมสายไหมและลวดลายต่าง ๆ\n\nจงเตรียมพร้อมสำหรับการปะทะ" },
	["cu_awp_hannya"] = { name = "Oni Taiji", desc = "มันถูกลงสีด้วยมือพร้อมภาพซามูไรและยักษ์ที่มีสีสันสดใส\n\nเผชิญหน้าปีศาจของคุณซะ" },
	["cu_m4a1s_metritera"] = { name = "Briefing", desc = "มันถูกลงสีด้วยลายแผนที่ภูมิประเทศโดยใช้ฟิล์มลอยน้ำ\n\nทุกคนมีแผน…" },
	["cu_m4a4_hellfire"] = { name = "Hellfire", desc = "สิ่งมีชีวิตที่ดูเหมือนปีศาจถูกลงสีด้วยลายไฟและโซ่\n\nและเต็มไปด้วยก้อนกรวด" },
	["am_mac10_aloha"] = { name = "Aloha", desc = "มันถูกลงสีแบบแอร์บรัชด้วยลายดอกชบาสีแดง\n\nสำหรับท่าทีที่ไม่เข้าข้างใคร" },
	["am_mag7_caustic"] = { name = "Hard Water", desc = "มันถูกลงสีด้วยลายสีเทาโดยถูกอโนไดซ์และลงไฮไลต์สีฟ้า เมื่อเสร็จงาน\n\n\"ฉันไม่ดื่มมันแน่\"" },
	["aq_ump45_flameflower"] = { name = "Metal Flowers", desc = "มันถูกลงสีด้วยลายกุหลาบงานศพพร้อมลงสีเหล็กโลหะ\n\nแด่อนุสรณ์ไว้อาลัย" },
	["cu_p2000_hunter"] = { name = "Woodsman", desc = "มันถูกลงสีด้วยมือพร้อมลายอำพรางสีเขียวแบบกำหนดเอง และลงรายละเอียดสีส้ม\n\n\"สีส้มนี้สำหรับคุณ ไม่ใช่ฉัน\"" },
