	["cu_ssg08_deathshead"] = { name = "Death's Head", desc = "มันถูกลงสีด้วยมือให้คล้ายกับปีกผีเสื้อเหยี่ยวรูปหัวกะโหลกแห่งความตาย\n\nสิ่งตอบแทน" },
