	["aq_sawed-off_flower"] = { name = "Morris", desc = "มันถูกลงสีด้วยมือโดยใช้ลายดอกไม้ประดับสีจางอ่อน ๆ\n\nได้เวลาปิดไตรมาสใหม่" },
	["cu_aug_orange_triangle"] = { name = "Triqua", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายสามเหลี่ยมสีปืนโลหะและใช้ไฟเบอร์คาร์บอนทับบนสีรองพื้นสีส้มแสด\n\nทุกสิ่งล้วนเท่าเทียมกัน" },
	["gs_ak47_empress"] = { name = "The Empress", desc = "มันถูกลงสีแบบกำหนดเองโดยใช้ลายไพ่ทาโรต์จักรพรรดินีเป็นแรงบันดาลใจ\n\nความมั่งคั่งมาได้ในหลายรูปแบบ" },
	["cu_bizon_all_in"] = { name = "High Roller", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายชิปโป๊กเกอร์ ลูกเต๋า ไพ่รอยัลฟลัชทับบนสีรองพื้นสีแดง\n\nเทหมดหน้าตัก" },
	["gs_g3sg1_cetme_redux"] = { name = "Hunter", desc = "สีดำรองพื้นของปืนได้ถูกคลุมด้วยแผงไม้สีดำเข้ม\n\nมันมีกลิ่นที่อุดมไปด้วยมะฮอกกานี" },
	["cu_p250_cybercroc"] = { name = "See Ya Later", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีเขียวเป็นลายจระเข้หุ่นยนต์พร้อมลงรายละเอียดด้วยสีเหลือง\n\nในขณะนั้นเอง…" },
	["cu_mp9_goo"] = { name = "Goo", desc = "มันถูกลงสีแบบกำหนดเองให้คล้ายกับเมือกน้ำมันดินบังทับบนสีรองพื้นสีเทา\n\nเจตนาร้ายที่ถูกปกปิด" },
	["cu_glock_indigo"] = { name = "Off World", desc = "มันถูกลงสีด้วยมือเป็นสีฟ้าที่ทาเคลือบอยู่หลายชั้น\n\nสีทาเคลือบบนสุดยังคงแห้งอยู่" },
	["gs_m4a1_shatter"] = { name = "Leaded Glass", desc = " มันถูกลงสีด้วยมือให้คล้ายกับแก้วสีน้ำเงินและสีส้มที่แตก\n\nความเปราะบางมีอันตรายถึงชีวิต" },
