	["gs_r8_llamacannon"] = { name = "Llama Cannon", desc = " ด้ามปืนงาช้างจับคู่กับปืนได้อย่างหรูหรา มีการแกะสลักลวดลายบนโลหะเป็นสีน้ำเงิน\n\nดึงคันโยกเลย" },
	["cu_tec9_cracked_opal"] = { name = "Cracked Opal", desc = "มันถูกลงสีด้วยมือให้คล้ายกับรอยร้าวของไม้โบราณโดยได้อิงจากสีโอปอล\n\nคู่ผสมเป็นแหวนสื่ออารมณ์" },
	["hy_scar20_jungle_slipstream"] = { name = "Jungle Slipstream", desc = "  มันถูกลงสีแบบกำหนดเองด้วยสีเขียวและเหลืองโดยใช้ฟิล์มลอยน้ำ\n\nสร้างการปลุกให้ตื่นได้ด้วยตัวคุณเอง" },
	["gs_sg553_phantom"] = { name = "Phantom", desc = "มันถูกลงสีด้วยมือดีไซน์สีน้ำเงินเทาและเสร็จงานด้วยการเน้นด้วยสีส้ม\n\nจัดหามาจาก ScyTech" },
	["gs_cz75_tacticat"] = { name = "Tacticat", desc = "มันถูกลงสีด้วยมือสีชมพูและม่วงที่โดดเด่นเล็กน้อย และมีสติกเกอร์รอยเท้าของแมว\n\nกระสุน 24 นัดกับแมว 9 ชีวิต" },
	["cu_ump45_x-ray_machine"] = { name = "Exposure", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายซึ่งคล้ายกรงซี่โครงกระดูกแบบเอกซเรย์และลงลายทั้งกระบอกปืน\n\n\"โปรดเอาวัตถุโลหะทั้งหมดออกจากกระเป๋าของคุณด้วย\"" },
