	["gs_aug_stymphalian_birds"] = { name = "Stymphalian", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพวาดนกสติมเฟเลียนจากเทพนิยายกรีก\n\nอาร์ทิมิสส่งนกไปด้วยความห่วงใย" },
	["gs_awp_death"] = { name = "Mortis", desc = "มันถูกลงสีแบบกำหนดเองโดยใช้ลายไพ่ทาโรต์แห่งความตายเป็นแรงบันดาลใจ\n\nทุกจุดจบล้วนมีการเริ่มต้นใหม่" },
	["cu_bizon_riot"] = { name = "Night Riot", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายพรางสีฟ้าน้ำเงิน\n\nสาเหตุเนื่องจากความโกลาหล" },
	["gs_fiveseven_hot_rod_violet"] = { name = "Flame Test", desc = "เปลวไฟสีเงินบนปากกระบอกปืนทับอยู่บนสีรองพื้นสีม่วงพร้อมเคลือบด้วยสะเก็ดโลหะ เมื่อเสร็จงาน\n\nองค์ประกอบธาตุที่พบ: Cs (ซีเซียม)" },
	["aa_glock_18_urban_moon_fever"] = { name = "Moonrise", desc = "ทิวทัศน์เมืองแบบสุ่มในด้านหน้าของภาพพร้อมดวงจันทร์เต็มดวงและสีม่วงของท้องฟ้ายามค่ำคืน\n\nดูดาวเหนือสิ" },
	["cu_m4a4_neo_noir"] = { name = "Neo-Noir", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายผู้หญิงสีน้ำเงินผสมสีม่วงแดงเข้มที่ดูทันสมัยบนสีรองพื้นโทนสีเทา\n\n\"เธอไขว่คว้าสิ่งที่เธอพอจะทำได้และหายไปสู่ดิสโทเปียที่กำลังพังทลาย\"" },
	["gs_mp7_bloodsport"] = { name = "Bloodsport", desc = "มันถูกคลุมไปด้วยสติกเกอร์โลโก้สีขาวบนฟิล์มลอยน้ำสีแดงและดำ \n\nพื้นที่สำหรับให้เช่า" },
	["cu_mp9_black_sand"] = { name = "Black Sand", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายพรางทหารสีน้ำตาลและสีดำ\n\n\"จบแคมเปญของพวกเขา ก่อนที่มันจะเริ่ม\"" },
	["sp_negev_lionfish"] = { name = "Lionfish", desc = "มันถูกลงสีด้วยสเปรย์พร้อมลายปลาสิงโตแบบสุ่ม\n\nว่ายน้ำต่อไป" },
	["gs_nova_anchorite"] = { name = "Wild Six", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพแนวชวนให้รู้สึกถึงวันสิ้นโลก\n\nปืนฉัน กฎฉัน" },
	["cu_p2000_urban_hazard"] = { name = "Urban Hazard", desc = "มันถูกลงสีแบบกำหนดเองด้วยด้ามปืนลายพรางโทนสีเทาและสไลด์ปืนสีแดง\n\nจำเป็นต้องใช้หมวกแข็งอย่างมากในจุดนี้" },
	["gs_revolver_tread"] = { name = "Grip", desc = "โลหะได้ถูกกดขึ้นรูปทรงอย่างพิถีพิถันและด้ามปืนที่ถูกเคลือบด้วยลวดลายยางสีฟ้า\n\nศัตรูทุกคนคือตะปูให้ตอก" },
	["sp_sg533_aloha"] = { name = "Aloha", desc = "มันถูกลงสีด้วยสเปรย์พร้อมลายดอกชบาสีน้ำเงิน\n\nคู่หูที่สมบูรณ์แบบ" },
	["aq_mag7_swag7"] = { name = "SWAG-7", desc = "มันถูกคลุมด้วยดีไซน์สีเงินและสีดำแบบโมโนโครเมทิก\n\nคุณอาจมีมันหรือไม่ก็ไม่มีเลย" },
	["cu_ump45_white_fang"] = { name = "Arctic Wolf", desc = "มัยถูกลงสีแบบกำหนดเองด้วยลายซึ่งคล้ายเสื้อคลุมสีขาวของหมาป่าขั้วโลกเหนือ\n\nทุกรอบเจอแต่ 1 ต่อ 5" },
	["cu_usp_cut"] = { name = "Cortex", desc = "มันถูกลงสีแบบกำหนดเองด้วยการเน้นสีชมพูทับบนสีเงินและสีรองพื้นสีดำ\n\nระวังหัวคุณไว้" },
	["cu_xm1014_oxide_blaze"] = { name = "Oxide Blaze", desc = "มันถูกลงสีแบบกำหนดเองด้วยรองพื้นสีสนิมและลงรายละเอียดสีขาว\n\nไม่เคยชินกับการเป็นตัวซัพพอร์ตแบกภาระสักที" },
	["cu_ak_neon_rider"] = { name = "Neon Rider", desc = "ลายนักซิ่งมรณะสามารถมองเห็นได้เบื้องหน้าของสีนีออนแบบต่าง ๆ พร้อมลวดลายผสมผสานอื่น\n\nมีสองส่วนคือ ผู้วางกับดัก ผู้เก็บรักษา ส่วนที่สามคือ ผู้ทำการสังเคราะห์" },
	["hy_aug_torn_orange"] = { name = "Amber Slipstream", desc = "มันถูกลงสีด้วยมือพร้อมลายควันสีเทาและสีส้มสดใสโดยใช้ฟิล์มลอยน้ำ\n\nโปรดเอามือและแขนของคุณไว้ภายในยานพาหนะ" },
	["cu_cz75_eco"] = { name = "Eco", desc = "มันถูกติดสติกเกอร์แบบถ่ายเทความร้อนบนสีรองพื้นสีขาวและสีเขียว\n\nสำหรับพรุ่งนี้ที่ดีกว่า" },
	["sp_elites_winter_raider"] = { name = "Shred", desc = "มันถูกลงสีด้วยสเปรย์พร้อมลายเส้นสีขาวและสีฟ้าบนสีรองพื้นสีดำ\n\nบางครั้งการคำรามอาจฉีกกระชากคุณได้" },
	["gs_deagle_aggressor"] = { name = "Code Red", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีรองพื้นสีแดงสดใสและลงรายละเอียดสีขาว\n\nทุกคนประจำตำแหน่งของคุณเอาไว้" },
	["gs_g3sg1_buccaneer"] = { name = "High Seas", desc = "มันถูกลงสีแบบกำหนดเองด้วยธีมเกี่ยวกับเรื่องการเดินเรือและตกแต่งด้วยงานโลหะทองเหลือง\n\nจงให้ความตายเป็นผู้นำทางคุณ" },
	["gs_glock_thunder_dust"] = { name = "Warhawk", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายเรื่องราวที่เตือนความทรงจำเกี่ยวกับเครื่องบินสงครามของยุคสมัยก่อน\n\nมันอาจจะไม่ใช่เครื่องบินที่ดีที่สุดในน่านฟ้า แต่เป็นเครื่องบินที่พร้อมใช้งานมากที่สุดในขณะนี้" },
	["cu_m4a1s_nightmare"] = { name = "Nightmare", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพผู้มาเยือนยามค่ำคืนที่น่ากลัว\n\nคราวหน้าตั้งการแจ้งเตือนไว้ด้วย" },
	["cu_mp9_vein"] = { name = "Capillary", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายเส้นเลือดดำที่ประกอบด้วยสีเขียวฟ้าที่ดูสลับซับซ้อนและลายแนวปะการัง\n\nอัตราการยิง 857 นัดต่อนาที" },
	["cu_nova_toy_soldier"] = { name = "Toy Soldier", desc = "มันถูกลงสีด้วยมือพร้อมเฉดสีที่ดูคุ้นเคยสีเขียวที่ชวนให้นึกถึงความทรงจำในวัยเด็ก\n\nกระสุนปืนและกองทหารได้ถูกส่งไปเป็นกลุ่มใหญ่" },
	["gs_p90_tread"] = { name = "Traction", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายหกเหลี่ยมสีฟ้าที่ถูกแบ่งส่วนออกมาเป็นดีไซน์เพื่อให้พอดีกับรูปทรงที่เป็นเอกลักษณ์ของปืน P90\n\nครึ่งหนึ่งของการต่อสู้คือการเก็บรักษาอาวุธไว้ อีกครึ่งหนึ่งคือการยิงให้โดนเป้าหมาย" },
	["am_awp_pawpaw"] = { name = "PAW", desc = "ลายแมว K-9 และสัตว์พร้อมปลอกคอสีแดง\n\nรางวัลการสังหารจ่ายให้เป็นที่ฝนเล็บและลูกเทนนิส" },
	["gs_powercore_mp7"] = { name = "Powercore", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีรองพื้นสีเขียวและลงไฮไลต์สีเหลือง\n\nกฎข้อที่ 2 – อย่าปะทะกันในที่สาธารณะ" },
	["cu_sawedoff_devourer"] = { name = "Devourer", desc = "มันถูกลงสีด้วยมือพร้อมลายที่คล้ายกับสัตว์ประหลาดกำลังกินคำพูดอยู่\n\nมันเสียมารยาท หากพูดตอนที่มีอาหารอยู่ในปากของคุณอยู่" },
	["cu_r8_survivalist"] = { name = "Survivalist", desc = "มันถูกลงสีด้วยมือพร้อมแถบสีเขียวทำให้เจ้าของผสมผสานการใช้งานเข้ากันด้วย และหลีกเลี่ยงการตรวจจับในสถานการณ์ที่ตึงเครียดได้\n\n\"ยิงแปดนัดและโดนศัตรูหลายตัว ดีกว่าให้พวกศัตรูมานับเอง\"" },
	["cu_tec9_snake"] = { name = "Snek-9", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายที่ได้แรงบันดาลใจจากงูโคเรล\n\n\"ถ้าสีแดงมาเจอกับสีเหลือง คุณคงเป็นเพื่อนที่ตายไปแล้ว\"" },
	["cu_famas_owl_orange"] = { name = "Eye of Athena", desc = "มันถูกลงสีด้วยมือพร้อมลายนกฮูกจักรกลอยู่บนยอดรังนกขนสีส้มและสีน้ำตาล\n\n+1 แด่สติปัญญา" },
	["cu_ak_island_floral"] = { name = "Wild Lotus", desc = "มันถูกลงสีแบบกำหนดเองด้วยมือเป็นลายดอกบัวสีส้มบนสีรองพื้นสีเขียว\n\nขี้โคลนหรือตำแย" },
	["hy_bloom_red"] = { name = "Day Lily", desc = "มันถูกลงสีด้วยลายดอกลิลลี่สีแดงโดยใช้ฟิล์มลอยน้ำ\n\nดอกลิลลี่บ่อยครั้งที่มักเกี่ยวข้องกับความตาย ขณะที่ยังความงาม" },
	["sp_bloom_orange"] = { name = "Sunset Lily", desc = "มันถูกลงสีด้วยสเปรย์พร้อมลายดอกลิลลี่สีส้ม\n\nในขณะที่มีความสวยงาม ดอกลิลลี่ก็มักจะมีความเกี่ยวข้องกับความตายอยู่บ่อยครั้ง" },
	["am_bloom_blue"] = { name = "Midnight Lily", desc = "มันถูกลงสีด้วยลายดอกลิลลี่โดยใช้สีมุกเพื่อเปลี่ยนสี\n\nดอกลิลลี่บ่อยครั้งที่มักเกี่ยวข้องกับความตาย ขณะที่ยังความงาม" },
	["sp_bud_green"] = { name = "Teal Blossom", desc = "มันถูกลงสีด้วยสเปรย์พร้อมลายกุหลาบตูมสีน้ำเงินเขียวอ่อน สีเขียว และสีส้ม\n\nมันไม่มีกุหลาบไร้หนามหรอก" },
	["hy_bud_red"] = { name = "Crimson Blossom", desc = "มันถูกลงสีด้วยลายดอกกุหลายตูมสีไวน์โดยใช้ฟิล์มลอยน้ำ\n\nมันไม่มีกุหลาบไร้หนามหรอก" },
