	["cu_ssg08_tickler"] = { name = "Bloodshot", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายสัตว์ประหลาดที่มีหนวดสีเขียวเหลือง มีฟันและลูกตา\n\nจะได้มองเห็นคุณได้ดีขึ้นไงล่ะ" },
