	["aq_m249_aztec"] = { name = "Aztec", desc = "ถูกขุดมาจากซากโบราณสถาน Aztec ชิ้นส่วนของ M249 นี้ได้ถูกสนิมกินและมีตะไคร่น้ำปกคลุมเอาไว้อยู่\n\nจงอย่าได้ไว้ใจสะพานเชือก" },
	["gs_dual_elites_classic"] = { name = "Elite 1.6", desc = "อักษรคำว่า ELITE ได้ถูกปั้มลงบนด้านข้างของปืน Dual Berettas รุ่นคลาสสิก\n\nวัสดุมักมีแหล่งที่มา" },
