	["cu_tec9_flash"] = { name = "Flash Out", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีที่คล้ายคลึงกับระเบิดแสง\n\nขอย้ำอีกครั้ง: จงเรียนเต้นรำกับจอร์แดน" },
	["cu_fiveseven_gsg9"] = { name = "Buddy", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีลายพรางและมีหน้าของหน่วยต่อต้านผู้ก่อการร้ายอยู่ใต้ท้ายศูนย์เล็ง\n\nเดี๋ยวฉันระวังหลังให้เอง" },
	["gs_p250_inferno"] = { name = "Inferno", desc = "มันถูกลงสีแบบกำหนดเองซึ่งสะท้อนให้เห็นถึงลักษณะเด่นของแผนที่ de_inferno ที่ถูกนำมาปรับใช้\n\n\"แต่ช่วยดูเวลาหน่อยเถอะ!\"" },
	["gs_mac10_dust_crate"] = { name = "Classic Crate", desc = "มันถูกลงสีด้วยมือซึ่งสีคล้ายคลึงกับกล่องเหล็กสีเขียวที่สามารถพบได้ทั่วไปในแผนที่ de_dust2\n\nวิ่งไปจุด B อย่าหยุด" },
	["gs_mag7_popdog"] = { name = "Popdog", desc = "มันถูกลงสีแบบกำหนดเองซึ่งสีคล้ายคลึงกับรถไฟที่มีรูปป๊อปด็อกพ่นอยู่ด้านข้าง\n\nช่างเป็นสุนัขที่มีชีวิตชีวา!" },
	["cu_mp9_hydra"] = { name = "Hydra", desc = "มันถูกลงสีแบบกำหนดเองซึ่งอ้างอิงมาจากปฏิบัติการ Hydra ปฏิบัติการที่ 8 ของ CS:GO\n\nคุ้มค่าที่รอคอยแน่นอน" },
