	["am_aug_death_by_doggy"] = { name = "Death by Puppy", desc = "มันถูกลงสีลายป๊อปด็อกหลากหลายสี\n\nอย่าไปสับสนกับ \"บันได\" นะ" },
	["cu_scar_assault"] = { name = "Assault", desc = "โลโก้ของศูนย์วิจัยถูกลงสีด้วยมือเป็นสีขาวบนสีรองพื้นสีน้ำเงิน\n\nนอกจากนี้ยังมีแบบสีแดงด้วยนะ" },
	["gs_mp5_fbi"] = { name = "Agent", desc = "มันถูกลงสีแบบกำหนดเองด้วยคำว่า FBI บนสีรองพื้นสีน้ำเงินและถูกเน้นลวดลายด้วยสีเหลือง\n\n\"ถึงเวลาที่จะได้รับรู้เรื่องราวของพวกเราแล้ว\"" },
