	["cu_awp_wildfire"] = { name = "Wildfire", desc = "โลโก้ปฏิบัติการ Wildfire ได้ถูกลงสีด้วยมือพร้อมเน้นสีดำบนสีรองพื้นสีแดง\n\nตะปูที่ยื่นออกมาอาจจะโดนค้อนทุบได้" },
