	["gs_famas_legacy_gold"] = { name = "Commemoration", desc = "มันถูกลงสีแบบกำหนดด้วยสีทองและลงรายละเอียดต่าง ๆ ที่โดดเด่นเกี่ยวกับการฉลองครบรอบ 20 ปี ของ Counter-Strike\n\nและนี่ฉลองสำหรับอีก 20 ปีข้างหน้า" },
