	["gs_awp_hydra"] = { name = "Desert Hydra", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายงูสีทองที่คืบคลานไปด้านหน้าของกระบอกปืน AWP ลำกล้องปืน กระบอกปืน และพานท้ายปืนถูกลงสีขาว\n\nตัดหัวไปหนึ่งจะงอกออกมาอีกสอง—นั่นคือความเสี่ยงที่คุณกล้าจะรับไหมละ? - วาเลเรีย เจนเนอร์ นักปฏิวัติ" },
