	["am_navy_shine"] = { name = "Navy Sheen", desc = "มันถูกลงสีด้วยลายพรางหลายชนิดสีน้ำเงินนาวีแบบอโนไดซ์\n\nทำไมมันเศร้าจัง?" },
	["gs_aug_sand_storm"] = { name = "Sand Storm", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพวาดของพายุทรายที่พัดผ่านภายใต้ท้องฟ้ายามค่ำคืน\n\nมีสิ่งสวยงามอยู่รอบตัวเรา เพียงแค่คุณรู้ว่าจะมองไปทางไหน" },
	["sp_dry_wood"] = { name = "Drift Wood", desc = "มันถูกลงสีสเปรย์พ่นด้วยลายที่คล้ายกับไม้แห้งสีน้ำตาล\n\nเคาะไม้ปลุกใจ นายต้องใช้โชคเท่าที่นายมี - เฟลิกซ์ ไรลีย์ ผู้บังคับบัญชาการ" },
	["sp_desert_skulls_dawn"] = { name = "Drought", desc = "มันถูกลงสีด้วยสเปรย์พ่นลายกะโหลกของสัตว์\n\nทุกสิ่งที่เหลืออยู่" },
	["sp_mirage_flowers_tan"] = { name = "Sienna Damask", desc = "มันถูกลงสีสเปรย์พ่นด้วยลายดอกไม้ดอกดามัสก์บนสีรองพื้นสีน้ำตาลทองของอาวุธ\n\nในทางเทคนิคแล้ว ลายพรางที่ดีที่สุดคือ ลายที่คุณไม่ทันสังเกตเห็นมัน..." },
	["sp_moro_carving_burnt"] = { name = "Humidor", desc = "มันถูกลงสีสเปรย์พ่นด้วยลายเถาวัลย์และดอกไม้ในเฉดสีน้ำตาลและสีม่วง\n\n\"พวกเขากำลังเก็บอะไรกันอยู่ในนั้น?\"" },
