	["gs_mp5_neon_flektarn"] = { name = "Oxide Oasis", desc = "มันถูกลงสีลายพรางสีส้มและสีเขียวฟ้าสดใส อาวุธถูกเน้นด้วยสีทองเมื่อทำเสร็จ\n\nอาวุธเงียบกระบอกนี้ไม่ควรมีเสียงดัง" },
	["aa_desert_bloom_bright"] = { name = "Desert Blossom", desc = "มันถูกลงสีสเปรย์พ่นด้วยลายดอกไม้สดใสพร้อมลายรองพื้นที่แห้งแล้งและแตกระแหง\n\nธรรมชาติมักชนะเสมอ" },
