	["cu_ak-47_phantom_disruptor"] = { name = "Phantom Disruptor", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายสัตว์ประหลาดลวงตาในรูปแบบของหมอกควันเคลือบลายไว้บนสีรองพื้นสีดำ\n\n\"มันจะเป็นอะไรก็ได้ตามที่มันอยาก อะไรก็ได้ตามที่มันต้องการ และมันเลือกที่จะสิงสถิตอยู่กับคุณ…\"" },
	["gs_aug_thunderstorm"] = { name = "Tom Cat", desc = "มันถูกลงสีด้วยลายลูกศรหันหลังและภาพแมวที่ดูร้ายกาจเน้นด้วยสีทองเคลือบไว้บนสีรองพื้นสีกันเมทัล\n\nเสียงฟ้าคะนองเป็นเสียงกรนของธรรมชาติ" },
	["cu_awp_vein"] = { name = "Capillary", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายเส้นเลือดดำที่ประกอบด้วยสีเขียวฟ้าที่ดูสลับซับซ้อนและลายแนวปะการัง\n\nกุญแจสำคัญแก่นแท้ของเจ้าหน้าที่มีราคา $4750" },
	["cu_cz75_cerakote"] = { name = "Distressed", desc = "เซรามิกสีทองแดงสึกหรอไปตามการใช้งาน\n\nดีขึ้นตามอายุการใช้งาน" },
	["cu_deagle_replica"] = { name = "Blue Ply", desc = "มันถูกลงเคลือบลามิเนตและลงสีขี้เถ้าที่ด้ามจับและลงสีน้ำเงินที่สไลด์ปืน\n\nคำเตือน: นี่คือการจำลองและไม่ได้ทดสอบด้วยกระสุนจริง" },
	["cu_m4a1s_csgo2048"] = { name = "Player Two", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีสันสดใสและภาพ GIGN CT และ Pop Dog เวอร์ชันอนิเมะ\n\nกดเริ่มสิ..." },
	["cu_mac10_nacre"] = { name = "Disco Tech", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีคล้ายโฮโลกราฟิกพร้อมสีไวนิลบนตัวปืนโดยเคลือบมุกตอนเสร็จ ลักษณะสีของปืนจะเปลี่ยนไปตามแสงที่ส่อง\n\nจงดูสิ่งที่คุณชี้" },
	["gs_mag7_justice"] = { name = "Justice", desc = "มันถูกลงสีแบบกำหนดเองโดยใช้ลายไพ่ทาโรต์รูปความยุติธรรมเป็นแรงบันดาลใจ\n\nการพิพากษาของทุกคน" },
	["cu_mp5_desert_strike"] = { name = "Desert Strike", desc = "มันถูกลงสีแบบกำหนดเองด้วยการออกแบบแนวไฮเทคในสีน้ำตาลและสีดำ\n\nยิงนัดแรก และนัดสุดท้าย" },
	["cu_negev_prototype"] = { name = "Prototype", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีขาวและสีแดง ซึ่งเป็นงานทาสีชั่วคราวในขณะที่การออกแบบเสร็จสิ้นแล้ว\n\nv1.2.1, PAT. 3422107" },
	["aq_p2000_acid_clover"] = { name = "Acid Etched", desc = "มันถูกลงสีสันหลากหลายแบบสุ่มพร้อมด้วยลายดอกโคลเวอร์หายากสี่ใบ\n\nคุณรู้สึกโชคดีไหม?" },
	["gs_r8_leviathan"] = { name = "Bone Forged", desc = "ด้ามจับของปืนลูกโม่นี้ถูกลงสีแบบกำหนดเองด้วยลายสัตว์ประหลาดใต้ทะเลโบราณที่ยังคงเหลืออยู่\n\nมีอะไรแฝงตัวอยู่ด้านล่าง" },
	["cu_sawedoff_apocalypto"] = { name = "Apocalypto", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายภาพมือที่กำลังเน่าเปื่อยซึ่งกำลังเอื้อมไปที่ดาวเคราะห์ที่คล้ายระเบิดพร้อมสีม่วงที่เป็นพื้นหลังของอวกาศ\n\n\"คุณมีเวลาไหม?\"" },
	["gs_scar20_enforcer"] = { name = "Enforcer", desc = "มันถูกลงสีด้วยการไล่ระดับสีของพระอาทิตย์บนชิ้นส่วนต่าง ๆ ของอาวุธอย่างประณีต\n\nการแก้ปัญหาแบบอัตโนมัติจาก SYMETRY SMART GUN CORP" },
	["cu_sg553_darkwing"] = { name = "Darkwing", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีแดงและดำโดยใช้ภาพขนนกและรายละเอียดสีเข้มอื่น ๆ\n\nสายตาเหยี่ยวนั้นอันตรายถึงตายได้ และคุณจะไม่เจอนกที่บินไม่ได้ตัวไหนจะอันตรายไปมากกว่านี้อีกแล้ว" },
	["cu_ssg08_fever_dream"] = { name = "Fever Dream", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีชมพู่มานิก สีฟ้า และภาพวาดมือสีม่วงบนสีรองพื้นสีดำ\n\nH@@HH@H@H@HA!!" },
	["cu_glock18_warmaiden"] = { name = "Bullet Queen", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพกระสุนสุดอันตรายและเทพีแห่งสงครามในชุดเเจ็กเกตสีชมพู่บนสีรองพื้นสีเหลืองและสีดำ\n\n\"ฉันจะหยุดยิงก็ต่อเมื่อแกเริ่มหุบปาก\"" },
	["cu_negev_ultralight"] = { name = "Ultralight", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายพรางดิจิทัลสีเทาและลูกศรสีเขียวฟ้า\n\nเบาไหม?" },
	["cu_ak47_anubis"] = { name = "Legion of Anubis", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายเทพอียิปต์อะนูบิสและราที่สื่อถึงความสมดุลระหว่างขีวิตและความตาย\n\nเขาอาจวัดความดีชั่วในตัวคุณ" },
	["aq_p2000_lost_world"] = { name = "Gnarled", desc = "มันถูกลงสีด้วยมือพร้อมภาพเอเลียนที่ตัวยืดอย่างบิดเบี้ยวจากด้ามจับไปจนถึงสไลด์ของปืน P2000 นี้\n\nจากมุมมืดของมิติอันไร้ที่สิ้นสุด" },
	["cu_mag7_monster_call"] = { name = "Monster Call", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายสัตว์ประหลาดใต้ทะเลในด้านหน้าและลงสีรองพื้นสีน้ำเงิน\n\nมันมักจะมีปลาสีเขียวที่ตัวใหญ่กว่าเสมอ" },
	["cu_printstream"] = { name = "Printstream", desc = "It has been custom painted with a stark black and white design and finished with pearlescent highlights.\n\nWHITE_1; BLACK_1; PEARLESCENT_1;" },
	["cu_glock_eyecontact"] = { name = "Vogue", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพสายตาคู่หนึ่งที่จ้องมองมา ซึ่งปืน Glock ได้รับแรงบันดาลใจมาจากป๊อปอาร์ต\n\n\"มองฉันในตอนที่ฉันกำลังจะยิงแกสิ!\"" },
	["gs_tec9_guerilla"] = { name = "Brother", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายพรางสีน้ำตาลและสีทองและมีภาพเจ้าหน้าที่ T อยู่ใต้ศูนย์เล็งด้านหลัง\n\nฉันจะระวังหลังให้" },
	["cu_mac10_isoonna"] = { name = "Allure", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพผู้หญิงในชุดสีน้ำเงินเขียว ผู้เชื่อในอิโซออนนะซึ่งยืนอยู่ท่ามกลางปลาคาร์ปและมีคลื่นซัดบนปืน MAC-10 นี้\n\nความงามอาจก่อให้เกิดการนองเลือด" },
	["gs_sg553_rusty"] = { name = "Ol' Rusty", desc = "เดิมทีเป็นเหล็กขัดเงา ความชื้นทำให้รูปลักษณ์ของอาวุธนี้เปลี่ยนไป และมีคำว่า \"Ol' Rusty\" ถูกประทับไว้เหนือไกปืน\n\nสนิมเนี่ยแหละ เพื่อนแท้" },
	["cu_ssg08_mainframe"] = { name = "Mainframe 001", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายไฮเทคสีฟ้าและสีม่วง\n\n_001 มีความลับอะไรกันนะ?" },
	["cu_p250_cassette"] = { name = "Cassette", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายที่มาจากแรงบันดาลใจของการแพ็กเทปวิดีโอจากยุคปี 1990\n\nเช็กเทปหน่อย" },
	["gs_p90_container"] = { name = "Freight", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายคล้ายขบวนรถไฟที่พ่นสีกราฟฟิตี้ไว้\n\nงานอาร์ตไม่ใช่ความป่าเถื่อน" },
	["cu_xm1014_amulet_blue"] = { name = "Entombed", desc = "XM-1014 ที่ค้นพบได้ไม่นานมานี้ถูกฝังไว้นานนับพันปี และมันลงสีแบบกำหนดเองด้วยลายผ้าห่อสีน้ำเงินและเน้นด้วยลายแนวชาวอียิปต์\n\nเหมาะสำหรับฟาโรห์" },
	["cu_m4a4_queenfairy"] = { name = "Tooth Fairy", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพที่สื่อถึงฟันหน้า ฟันกราม และภูติพิทักษ์ฟันสุดสะพรึ่ง\n\nไม่มีใครบอกสักหน่อยว่าฟันเป็นของคุณ…" },
	["gs_galil_phoenix"] = { name = "Connexion", desc = "โลโก้ฝ่ายฟีนิกซ์ได้ถูกลงสีด้วยสเปรย์บนสีรองพื้นสีขาวและสีแดง\n\nพวกมันกำลังเอาปืนกระบอกใหญ่มา" },
	["gs_bizon_hellraider"] = { name = "Runic", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายรูนที่ไม่ทราบที่มาและแมกกาซีนที่ดูคล้ายปืนแก็ตลิง\n\nส่งพวกมันลงนรกซะ" },
	["gs_mp5sd_wasteland_legacy"] = { name = "Kitbash", desc = "20 ปีแห่งการออกแบบปืน MP5 ได้ถูกลงสีแบบกำหนดเอง ยึดเข้ากับเทปกาว สายรัด และกาว\n\nถ้าเป็นครั้งแรก (ครั้งสองและสาม) คุณจะไม่ประสบความสำเร็จหรอก…" },
	["gs_awp_exoskeleton"] = { name = "Exoskeleton", desc = "โลหะบนปืน AWP นี้ถูกกดอย่างประณีตพร้อมรูปหัวกะโหลกที่เชื่อมถึงกัน\n\nเอียงได้เต็มที่ไปเลย" },
	["gs_cz75_vendetta"] = { name = "Vendetta", desc = "ตลอดหลายปีที่ผ่านมามันได้ถูกจารึกไว้ วาดเอาไว้ และทรหดขึ้นตามการใช้งาน\n\nอยากได้ก็ข้ามศพฉันไปก่อนเถอะ" },
	["hy_p90_dino_rampage"] = { name = "Cocoa Rampage", desc = "มันถูกลงสีด้วยลายการ์ตูนไดโนเสาร์สีเขียวมะกอกและสีทองโดยใช้ฟิล์มลอยน้ำ\n\nมีทั้งไดโนเสาร์ เอเลียน และดาวหาง โอ้ คุณพระช่วย!" },
	["gs_dual_elites_dezastre"] = { name = "Dezastre", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายไฮเทคสีดำ สีขาว และงานออกแบบสีแดง\n\nปฏิบัติตามคู่มือของผู้ผลิตเสมอเพื่อการใช้งานที่ปลอดภัย" },
	["cu_five_seven_diary"] = { name = "Fairy Tale", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพเจ้าหญิง ม้ายูนิคอร์น ดอกไม้สวยงาม และปราสาทที่อยู่ห่างออกไป\n\n\"วันนี้ต้องเป็นวันดีแน่ ๆ — ฉันรู้สึกได้เลย\"" },
	["gs_g3sg1_disrupt"] = { name = "Digital Mesh", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีแดง ขาว และสีชาร์โคลด้วยลายพรางดิจิทัล (DDPAT)\n\nสลับซับซ้อน" },
	["gs_galil_vandal"] = { name = "Vandal", desc = "มันถูกลงสีรองพื้นสีเขียวคลุมไว้พร้อมภาพวาดที่กระจัดกระจาย\n\nภาพวาดบางภาพจะบอกเล่าเรื่องราว ซึ่งบางภาพมีเรื่องน่าจดจำมากกว่าภาพอื่น ๆ" },
	["cu_p250_infect"] = { name = "Contaminant", desc = "ปืนถูกสีน้ำตาลแดงเข้มกินกลืนจนหมด เหลือทิ้งไว้แค่ปืนสภาพเน่าเปื่อยที่เหลือให้ใช้งานได้อย่างจำกัด\n\nมันก็แย่อย่างที่เห็นนั่นแหละ" },
	["cu_m249_deep_relief"] = { name = "Deep Relief", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีทรายที่มีเลเยอร์ด้านบนเป็นสีเขียวเข้มเป็นร่องลึกจนคุณรู้สึกได้\n\nใช้กระสุนกี่นัดถึงจะยิงโดนตรงกลาง?" },
	["cu_m4a4_cyberpunk"] = { name = "Cyber Security", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายเส้นทแยงมุมสีฟ้า สีแดง และสีทองบนสีรองพื้นสีดำของปืน M4 กระบอกนี้\n\nพร้อมวางจำหน่ายแล้วในขณะนี้ที่ร้านค้าปลีกไซเบอร์เนติกใกล้บ้านคุณ" },
	["gs_mp5_conditionzero"] = { name = "Condition Zero", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีน้ำเงินและสีเหลืองที่แสดงความเคารพต่อเกม Counter-Strike: Condition Zero.\n\n\"RPG จากทาง 3 นาฬิกา! หลบเร็ว!\"" },
	["cu_nova_polymer"] = { name = "Clear Polymer", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีที่ทำให้ดูโปร่งใส ทำให้คุณสามารถดูภายในอาวุธได้\n\nเป้าหมายของคุณชัดเจน" },
	["cu_glock_noir"] = { name = "Neo-Noir", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายผู้หญิงสีม่วงแดงสองคนที่ดูทันสมัยบนสีรองพื้นโทนสีเทา\n\n\"สิ่งต่าง ๆ เริ่มกลับตาลปัตร และเธอก็เริ่มมีความหวัง—จากนั้นเธอจึงเงยหน้าขึ้น\"" },
	["cu_ssg08_chromatic"] = { name = "Parallax", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีตำแหน่งออฟเซต ซึ่งนำไปสู่ลักษณะที่สะดุดตา\n\nยิงซ้ำสอง ฆ่าในคราวเดียว" },
	["gs_ump_gold_bismuth"] = { name = "Gold Bismuth", desc = "มันถูกลงลายบิสมัทสีทองขนาบด้วยสีขาวและสีรองพื้นสีดำ\n\n\"คุณมีรสนิยมที่แพงมาก…\"" },
	["cu_usp_krokos"] = { name = "Monster Mashup", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายมอนสเตอร์สีเขียวและภาพไอคอนที่ได้รับแรงบันดาลใจจากศิลปะเมืองอันยอดนิยม ท่อเก็บเสียงถูกเคลือบด้วยสีเคลือบเงาไข่มุก\n\nX__X" },
