	["am_m4a1s_bluesmoke"] = { name = "Blue Phosphor", desc = "มันถูกลงสีน้ำเงินเมมัลลิกหลายชั้นบนสีรองพื้นสีน้ำเงินเคลือบโครเมียม\n\nรู้สึกเศร้าไหม?" },
	["cu_ak_xray"] = { name = "X-Ray", desc = "AK-47 ลงสีแบบกำหนดเองแสดงให้เห็นภายในของปืนด้วย X-Ray\n\nเมื่อทุกอย่างเปิดเผย คุณอาจไม่ชอบสิ่งที่เห็น..." },
	["am_heist_plans_green"] = { name = "Heist", desc = "มันถูกลงสีด้วยลายแผนที่สีเบจแบบอโนไดซ์ ดูเหมือนว่าจะมีใครบางคนวาดแผนที่ไว้ด้านบนตั้งแต่ถูกใช้งานครั้งแรก\n\nการวางแผนเป็นอีกหนึ่งสิ่ง การดำเนินการก็เป็นอีกสิ่ง" },
	["am_heist_plans_purple"] = { name = "Night Heist", desc = "มันถูกลงสีด้วยลายแผนที่สีม่วงแบบอโนไดซ์ ดูเหมือนว่าจะมีใครบางคนวาดแผนที่ไว้ด้านบนตั้งแต่ถูกใช้งานครั้งแรก\n\nการวางแผนเป็นอีกหนึ่งสิ่ง การดำเนินการก็เป็นอีกสิ่ง" },
	["am_heist_plans_yellow"] = { name = "Vault Heist", desc = "มันถูกลงสีด้วยลายแผนที่สีเทาแบบอโนไดซ์ ดูเหมือนว่าจะมีใครบางคนวาดแผนที่ไว้ด้านบนตั้งแต่ถูกใช้งานครั้งแรก\n\nการวางแผนเป็นอีกหนึ่งสิ่ง การดำเนินการก็เป็นอีกสิ่ง" },
	["hy_houndstooth_brown"] = { name = "Houndstooth", desc = "มันถูกลงสีด้วยลายหยักสีน้ำตาลโดยใช้ฟิล์มลอยน้ำ\n\nสวมบทบาทที่คุณต้องการ ไม่ใช่สวมบทบาทที่คุณมี" },
	["gs_mac10_snake"] = { name = "Hot Snakes", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายหนังงูสีทองแดงและมีลายงูขดใต้ท้ายแบบลวด\n\nเสียงฟู่คือกระสุนที่บินผ่านคุณไป" },
	["hy_phoenix_tags_lilac"] = { name = "Phoenix Chalk", desc = "มันถูกลงสีด้วยลายกราฟฟิตี้ของ Phoenix Connexion พร้อมลงสีสันที่หลากหลาย\n\n\"เอ็งมันโง่ที่คิดว่าเอ็งจะชนะ!\"" },
