	["hy_phoenix_tags_red"] = { name = "Phoenix Stencil", desc = "มันถูกลงสีด้วยลายกราฟฟิตี้ของ Phoenix Connexion พร้อมลงสีสันที่หลากหลาย\n\n\"เรายอมถูกฆ่าไม่ได้!\"" },
	["sp_phoenix_tags_purple"] = { name = "Phoenix Blacklight", desc = "มันถูกลงสีด้วยลายกราฟฟิตี้ของ Phoenix Connexion พร้อมลงสีสันที่หลากหลาย\n\n\"เดี๋ยวเราจะไปยืนเต้นบนหลุมฝังศพของแก!\"" },
	["hy_tigers_tan"] = { name = "Clay Ambush", desc = "มันถูกลงสีด้วยลายเสือสีน้ำตาลและสีแทนโดยใช้ฟิล์มลอยน้ำ\n\nโดยปกติเหล่านักล่าเดี่ยว จะสร้างข้อยกเว้นให้คุณ" },
