	["cu_m4a1_snake"] = { name = "Welcome to the Jungle", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายที่นำเสนอเกี่ยวกับประติมานวิทยาโบราณและงูไวเปอร์สีทอง และมีฉากหลังเป็นป่าทึบ\n\nจู่โจมโดยไร้คำเตือน" },
	["cu_ak_jaguar"] = { name = "Panthera onca", desc = "ไม้ที่พานท้ายและกระโจมมือปืนนำเสนอเกี่ยวกับงานแกะสลักที่สวยงาม ซึ่งดึงดูดความสนใจจากภาพลงสีแบบกำหนดเองลายเสือจากัวร์ที่ด้านข้างของปืนได้เป็นอย่างดี\n\nใครบอกว่าคุณจะเปลี่ยนจุดยืนของคุณไม่ได้?" },
	["cu_jaguar_p90"] = { name = "Run and Hide", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายจากัวร์และลายหนังพับเบิล\n\nไม่ว่าใครก็ซื้อของแฟชันได้ แต่น้อยคนที่จะมีสไตล์แฟชันที่แท้จริง" },
	["aa_ancient_brown"] = { name = "Ancient Earth", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายเส้นที่สลับซับซ้อนและภาพสิ่งมีชีวิตโบราณสีน้ำตาลและสีทอง\n\nสิทธิพิเศษเป็นของคุณ" },
	["am_ancient_warm"] = { name = "Ancient Lore", desc = "มันถูกลงสีด้วยลายกระเบื้องโบราณสีเขียวอ่อน สีเบจ และสีแดง\n\n\"ความหวังยังคงอยู่ แม้แต่กับเหล่าผู้ที่เริ่มเดินในเส้นทางที่ผิด\"" },
	["aa_ruins_green"] = { name = "Lush Ruins", desc = "มันถูกลงสีด้วยภาพเทพโบราณที่ถูกบดบังด้วยพื้นหลังของใบไม้ใบหญ้านี้\n\n\"ระวังตัวนะทุกคน—พวกเราถูกจับตามองอยู่...\"" },
	["hy_ancient_tiles_peach"] = { name = "Blast From the Past", desc = "มันถูกลงสีด้วยลายกระเบื้องโบราณสีเขียวอ่อน และสีเบจ\n\n\"ความหวังยังคงอยู่ แม้แต่กับเหล่าผู้ที่เริ่มเดินในเส้นทางที่ผิด\"" },
	["am_gold_brick"] = { name = "Gold Brick", desc = "สีทองส่องสว่างเป็นประกายแสงและโดดเด่นในทุกแง่ของความสวยงามที่ไม่สมบูรณ์แบบของอาวุธ\n\nมีแต่ประกายระยิบระยับ..." },
