	["hy_ruins_red"] = { name = "Dusk Ruins", desc = "มันถูกลงสีด้วยภาพเทพโบราณที่ถูกบดบังด้วยพื้นหลังของใบไม้ใบหญ้านี้\n\n\"ระวังตัวนะทุกคน—พวกเราถูกจับตามองอยู่...\"" },
	["am_jade"] = { name = "Carved Jade", desc = "มันถูกลงสีด้วยสีรองพื้นโครเมียนและเคลือบสีเขียวหยกโปร่งใสแบบอโนไดซ์\n\nนี่คือที่สุดของความประณีต" },
	["am_ancient_wine"] = { name = "Ancient Ritual", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายเส้นที่สลับซับซ้อนและภาพสิ่งมีชีวิตโบราณสีน้ำตาลแดงและสีเงิน\n\nสิทธิพิเศษเป็นของคุณ" },
	["hy_drywood_green"] = { name = "Tall Grass", desc = "มันถูกลงสีหญ้าเขียนโดยใช้ฟิล์มลอยน้ำ\n\nหญ้าที่สูงขึ้นไม่มีอะไรดีขึ้นเลย" },
	["am_black_panther"] = { name = "Panther Camo", desc = "มันถูกลงสีลายจุดเสือดำ\n\nจงค้นหาจุดที่เป็นเงามืดของคุณ" },
	["gs_ak47_professional"] = { name = "Slate", desc = "มันถูกลงสีแบบกำหนดเองด้วยคำอธิบายไว้ว่า \"ดำในดำในดำสนิท\"\n\n\"เรียกหมอที พวกเขาต้องการหมอ\"" },
	["cu_cz75_whirlwind"] = { name = "Circaetus", desc = "มันถูกลงสีแบบกำหนดเองด้วยภาพนกล่าเหยื่อที่กำลังแบกงูบินไปบนปืน CZ75 กระบอกนี้\n\nตัวกินงู และเพลงประกอบธีมที่ติดหู" },
	["cu_mp9_food_chain"] = { name = "Food Chain", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีสันสดใสพร้อมด้วยภาพห่วงโซ่อาหารของมอนสเตอร์บนปืน MP9 กระบอกนี้\n\nกินหรือถูกกิน" },
	["cu_galil_chroma_pink"] = { name = "Chromatic Aberration", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีตำแหน่งออฟเซต ซึ่งนำไปสู่ลักษณะที่สะดุดตา\n\n(ไม่น่า)ดึงดูดสายตามาก..." },
	["gs_glock_polymer"] = { name = "Clear Polymer", desc = "มันถูกลงสีน้ำตาลที่สไลด์และสีน้ำเงินที่ไกปืน โครงปืนทำมาจากโพลีเมอร์ใส\n\nสิ่งที่คุณเห็นคือสิ่งที่คุณจะได้" },
	["gs_usps_hangedman"] = { name = "The Traitor", desc = "มันถูกลงสีแบบกำหนดเองโดยใช้ลายไพ่ทาโรต์รูปชายแขวนคอเป็นแรงบันดาลใจ\n\nอดีตที่ล้มเหลวเป็นพิมพ์เขียวของความสำเร็จในอนาคต" },
	["cu_m4a4_love"] = { name = "In Living Color", desc = "มันถูกลงสีแบบกำหนดเองด้วยสีนีออนและคลุมด้วยงานออกแบบภาพวาดด้วยมือ\n\nสู้เพื่อสิ่งหนึ่งหรือสู้เพื่อทุกสิ่ง" },
	["gs_m249_combine"] = { name = "O.S.I.P.R.", desc = "ปืน M249 นี้ถูกลงสีแบบกำหนดเองด้วยสีเทาปืนกลและพร้อมลายโลโก้รวมกัน\n\nปืนไรเฟิลพัลซ์ฉบับมาตรฐานการเฝ้าระวัง" },
	["cu_negev_devtexture"] = { name = "dev_texture", desc = "มันถูกลงสีแบบกำหนดเองด้วยพื้นผิวของผู้พัฒนาพร้อมสีรองพื้นสีส้มและสีเทา\n\nได้เวลา hammer.exe" },
	["gs_p250_cybershell"] = { name = "Cyber Shell", desc = "มันถูกลงสีแบบกำหนดเองด้วยสไลด์สีเงินและกริปพื้นผิวหกเหลี่ยม\n\nคุณเป็นตัวแทนของแนวหน้าในการรักษาความปลอดภัยไซเบอร์ของเรา" },
	["cu_mac10_portable"] = { name = "Button Masher", desc = "มันถูกลงสีแบบกำหนดเองให้ดูคล้ายกับเกมแพดและมีปุ่มกดมากมายให้กดผ่านโครงโพลีเมอร์ใส\n\nมอบความหมายใหม่ให้วลีเด็ดอย่าง \"สงครามเครื่องคอนโซล\" ใหม่หมดจด" },
	["aq_xm1014_punk"] = { name = "XOXO", desc = "มันถูกลงสีจี๊ดสดใสซึ่งได้แรงบันดาลใจจากความพังก์\n\nเย้ ใช่เลย…" },
	["gs_r8_rustking"] = { name = "Junk Yard", desc = "มันถูกลงสีด้วยภาพวาดและข้อความเขียนด้วยมือสีเงิน รังเพลิงและศูนย์เล็งด้านหน้าถูกลงสีแดงไว้\n\nเหมาะสำหรับราชา" },
	["gs_sg553_deathmetal"] = { name = "Heavy Metal", desc = "มันถูกลงไฮไลต์สีส้มและสีเหลืองบนสีรองพื้นสีดำ มีดาวสามดวงถูกลงสีไว้ที่ใกล้ด้านหลังท้ายด้ามปืน\n\n\"หนึ่งในปุ่มเหล่านี้คือปุ่มเทอร์โบ ซึ่งฉันเองก็จำไม่ค่อยได้เหมือนกัน…\"" },
