	["sp_hazard_bravo"] = { name = "sp_hazard_bravo", desc = "นี่คือของที่ระลึกจาก Siege มันถูกลงสีด้วยลายเส้นเตือนอันตรายโดยใช้สเปรย์\n\nอย่าข้าม" },
	["sp_tape_dots_bravo"] = { name = "sp_tape_dots_bravo", desc = "นี่คือของทีระลึกจาก Gwalior มันถูกลงสีด้วยสเปรย์โดยใช้เทปกาวและโลหะเจาะรูเป็นลายฉลุ\n\nอย่ากังวลไป...ธุรกิจกำลังจะมาแล้ว - นักค้าอาวุธ บูธ" },
	["sp_palm_bravo"] = { name = "sp_palm_bravo", desc = "นี่คือของทีระลึกจาก Gwalior มันถูกลงสีด้วยสเปรย์โดยใช้กล่องกระดาษที่ถูกตัดออกมา ตาข่าย และใบต้นปาล์มเป็นลายฉลุ\n\nสวยงามวันนี้...ขี้เถ้าวันหน้า" },
	["hy_ddpat_bravo"] = { name = "hy_ddpat_bravo", desc = "นี่คือของที่ระลึกจาก Ruins มันถูกลงสีด้วยลายพรางดิจิทัล (DDPAT) โดยใช้ฟิล์มลอยน้ำ\n\nแม้ว่าคุณจะไม่เห็นมัน แต่คุณได้ยินมันแน่นอน" },
	["so_jungle_bravo"] = { name = "so_jungle_bravo", desc = "นี่คือของที่ระลึกจาก Ruins มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบป่าทึบ\n\nสำหรับเหล่าผู้ที่กระหายการทำลายล้าง" },
	["so_tornado_bravo"] = { name = "so_tornado_bravo", desc = "นี่คือของที่ระลึกจาก Ali มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบทอร์นาโด\n\nคำพูดเป็นเพียงลม แต่ลมสามารถฆ่าเราได้" },
	["so_sand_bravo"] = { name = "so_sand_bravo", desc = "นี่คือของที่ระลึกจาก Gwalior มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบเนินทราย\n\nผู้สื่อข่าวของกอนโซ ชื่อ อเล็กซ์ คินเคด หายตัวไปหลังเดินทางไปยังมาเกร็บเพื่อรายงานการคุ้มกันปฏิบัติการ Vanguard" },
	["so_olive_bravo"] = { name = "so_olive_bravo", desc = "นี่คือของที่ระลึกจาก Cache มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีรูปแบบสีเขียวอมเหลือง\n\nไม่เคยได้รับชัยชนะ" },
	["an_gunmetal_bravo"] = { name = "an_gunmetal_bravo", desc = "นี่คือของที่ระลึกจาก Siege มันถูกลงสีด้วยสีเทาโลหะรูปแบบอโนไดซ์บนสีรองพื้นโครเมียม\n\nคุณไม่รู้จักเฟลิกซ์ ไรลีย์ดีพอเหมือนอย่างที่ฉันรู้จัก... ชายคนนี้เป็นผู้ทำลายความเป็นไปไม่ได้ - The Traitor and The Truthseeker Part 1" },
	["am_ossify_blue_p2000_bravo"] = { name = "am_ossify_blue_p2000_bravo", desc = "นี่คือของที่ระลึกจาก Seaside มันถูกลงสีด้วยสีน้ำเงินโปร่งแสงแบบนามธรรมโดยใช้ฟิล์มลอยน้ำบนสีรองพื้นเมทัลลิก\n\nคลื่นซัดทำลาย แต่การเตรียมใจของพวกเราไม่มีทางถูกทำลายลงได้ - ผู้เชี่ยวชาญการบุกทะลวง โคทาโร่ อิซากิ" },
	["am_crumple_bravo"] = { name = "am_crumple_bravo", desc = "นี่คือของที่ระลึกจาก Agency มันถูกลงสีด้วยรูปหลายเหลี่ยมพร้อมด้วยสีเมทัลลิกที่มีค่าสะท้อนแสงหลายจุดบนสีรองพื้นโครเมียม\n\nวางดินสอลง ชูมือขึ้น" },
	["aq_steel"] = { name = "aq_steel", desc = "มันยังคงสามารถใช้งานได้อย่างดีเยี่ยม ถึงแม้ว่าสภาพบนพื้นผิวจะเป็นสนิมแล้วก็ตาม\n\nบางคนก็ไม่ต้องการที่จะซ่อนการกระทำของตนถึงแม้ว่าจะมีความชั่วช้าขนาดไหนก็ตาม" },
	["hy_hex"] = { name = "hy_hex", desc = "มันถูกลงสีด้วยลายหกเหลี่ยมโดยใช้ฟิล์มลอยน้ำ" },
	["hy_camo_large"] = { name = "hy_camo_large", desc = "มันถูกลงสีด้วยลายพรางที่มีขนาดใหญ่เกินไปโดยใช้ฟิล์มลอยน้ำ" },
	["am_ddpatdense"] = { name = "am_ddpatdense", desc = "มันถูกคลุมด้วยฟอยล์โลหะจากนั้นถูกประทับด้วยลายพรางดิจิทัล" },
	["twigs"] = { name = "twigs", desc = "มันถูกลงสีด้วยสเปรย์พ่นด้วยมือแบบอิสระโดยใช้กิ่งไม้เป็นลายฉลุ" },
	["varicamo"] = { name = "varicamo", desc = "มันถูกลงสีด้วยลายพรางหลายชนิดโดยใช้ฟิล์มลอยน้ำ\n\nการสร้างใหม่จะเกิดขึ้นหลังถูกการทำลายเท่านั้น" },
	["aq_damascus_knife"] = { name = "aq_damascus_knife", desc = "มันถูกหลอมจากท่อนเหล็กที่ทำจากเหล็กคาร์บอนที่ต่างกันสองชนิด\n\nในที่สุด อาวุธก็แข็งแกร่งพอที่จะแก้ไขสถานการณ์แมตช์ของคุณได้" },
	["am_crystallized"] = { name = "am_crystallized", desc = "มันถูกลงสีด้วยสีโลหะและใช้รอยตกผลึกเพื่อสร้างลาย\n\nทุกคนต้องการสร้างผลกระทบ" },
	["snakeskin"] = { name = "snakeskin", desc = "มันถูกลงสีด้วยลายงูโดยใช้ฟิล์มลอยน้ำ\n\nฉันรู้ว่าคุณไม่เชื่อในสาเหตุ...และเมื่อฉันเปิดเผยคุณ Valeria จะมาเอาหัวของคุณแน่ - The Shield and The Serpent Part 1" },
	["cu_usp-s_elegant"] = { name = "cu_usp-s_elegant", desc = "มันถูกลงสีด้วยสีน้ำเงินเข้มและลงลายฉลุด้วยโลโก้ CT บนสไลด์ของปืน\n\nฉันสามารถทำตามข้อปฏิบัติและช่วยออกมา 7 คน หรือจะให้ฉันทำในแบบของฉันและช่วยออกมาได้ทั้งหมด 10 คน... คุณเลือกเองนะ - ผู้เชี่ยวชาญการแทรกซึม คาร์เมน โคซิเนโร" },
	["hy_plaid2"] = { name = "hy_plaid2", desc = "มันถูกลงสีด้วยลายตารางหมากรุกในสีน้ำตาลอมเทาและสีเขียวอมน้ำเงินโดยใช้ฟิล์มลอยน้ำ\n\nมันไม่ใช่ปี่สก็อต แต่มันจะเล่นเพลงก่อนงานศพทุกงาน" },
	["cu_fiveseven_urban_hazard"] = { name = "cu_fiveseven_urban_hazard", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายพรางที่ดูเรียบร้อยและการเน้นสีแดง\n\nทุก ๆ ปี นักออกแบบปืนชั้นแนวหน้าของโลก จะนำผลงานออกแสดงงานที่ตัวเองออกแบบล่าสุด" },
	["an_emerald"] = { name = "an_emerald", desc = "มันถูกลงสีด้วยสีรองพื้นโครเมียมและลงสีแคนดี้ในสีแดงม่วงโปร่งแสงและสีถ่านรูปแบบอโนไดซ์\n\nนี่เป็นอะไรที่ยอดมาก เซบาสเตียน เฮนเนเคตถูกลดขั้นงั้นเหรอ? ไอ้ครูฝึกจอมจู้จี้เนี่ยนะ? แล้วจะเกิดอะไรขึ้นกับคุณละ... - The Teacher and The Iconoclast Part 2" },
	["so_keycolors"] = { name = "so_keycolors", desc = "มันถูกลงสีด้วยสเปรย์สีเดียวในแต่ละส่วนโดยการจัดโครงสีด้วยสีน้ำเงินและสีส้ม\n\nควอไลเซอร์ที่ยอดเยี่ยม" },
	["cu_awp_mastery"] = { name = "cu_awp_mastery", desc = "มันถูกลงสีแบบกำหนดเองโดยใช้ลายฉลุอย่างประณีตและลงรายละเอียดด้วยรูปลอกใช้ความร้อนโดยใช้การผสมของฟิล์มลอยน้ำ\n\nเชส เทอร์เนอร์เคยเป็นคนดี... เหมือนอย่างคุณเคยมีรองเท้าใหญ่ขึ้นเพื่อใส่ – The Phoenix and The Initiate Part 1" },
	["aq_dualberettas_cartel"] = { name = "aq_dualberettas_cartel", desc = "มันถูกแกะสลักด้วยรูปโครงกระดูก ดอกไม้ และงู\n\nนั่นเป็นเหตุผลที่ฮักซ์ลีย์กำลังแบกรับภาระที่หนักอึ้ง เรามีแต่ต้องผลักดันเธอไปข้างหน้า... - The Serpent and The Truth Seeker Part 2" },
	["aq_famas_contour"] = { name = "aq_famas_contour", desc = "มันถูกลงสีแบบกำหนดเองด้วยดีไซน์สีแดงและสีเทาทันสมัยที่เติมเต็มรูปร่างของอาวุธ\n\nเราแข็งแกร่งด้วยกันเสมอ" },
	["cu_nova_hyperbeast"] = { name = "cu_nova_hyperbeast", desc = "มันถูกลงสีแบบกำหนดเองด้วยรูปสัตว์ร้ายในสีสันฉูดฉาด\n\nพวกเขาเรียกคุณว่า โอนิ ใช่ไหม? ชื่อน่ากลัวสำหรับคนน่าเศร้านะ... – ทหารรับจ้าง เอลเลียต คิงส์แมน" },
	["hy_ocean_knife"] = { name = "hy_ocean_knife", desc = "มันถูกลงสีโดยใช้ฟิล์มลอยน้ำลายพรางสีฟ้า" },
	["cu_m4a1s_printstream"] = { name = "cu_m4a1s_printstream", desc = "มันถูกลงสีแบบกำหนดเองด้วยลายสีดำและสีขาวล้วนพร้อมเน้นด้วยสีเคลือบเงาไข่มุก\n\nขาว_1; ดำ_1; เงาไข่มุก_1; ที่เก็บเสียง_1;" },
	["cu_usp_printstream"] = { name = "cu_usp_printstream", desc = "It has been custom painted with a stark black and white design and finished with pearlescent highlights.\n\nWHITE_1; BLACK_1; PEARLESCENT_1; SILENCED_1; PISTOL_1;" },
